(6, 'Milagros Montaña', '45635165', '2004-03-11', '2645288971', '<ul>\r\n<li>Sobrepeso</li>\r\n<li>Peso: 88.5 kg.&nbsp; Altura 1.67&nbsp;</li>\r\n</ul>\r\n<p>&nbsp;</p>', '14', '2024-04-15 10:41:37'),
(7, 'Quintero Valentina', '49281059', '2009-02-02', '2644121347', '<p><strong>E<span style=\"font-family: \'book antiqua\', palatino, serif;\">dad 15 a&ntilde;os.<br></span></strong><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Estado Civil: </strong>Soltera.</span><br><span style=\"font-family: \'book antiqua\', palatino, serif;\">No esta de novia ni tiene ningun tipo de relacion. <br></span><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Convive: </strong>Padres y 2 hermanas, es la menor de la familia.<br></span><span style=\"font-family: \'book antiqua\', palatino, serif;\">El padre es retirado de la policia, la mam&aacute; ama de casa.&nbsp;</span></p>\r\n<p><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Diagnostico actual:</strong> <em><strong>Miastenia gravis</strong></em>, donde la&nbsp;enfermedad es ocasionada por una interrupci&oacute;n en la comunicaci&oacute;n entre los nervios y los m&uacute;sculos.</span></p>\r\n<div class=\"m6vS6b PZPZlf\" data-attrid=\"kc:/medicine/disease:long description\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">Los s&iacute;ntomas incluyen debilidad en los m&uacute;sculos de los brazos y las piernas, visi&oacute;n doble y dificultades para hablar y masticar.</span></div>\r\n<div class=\"m6vS6b PZPZlf\" data-attrid=\"kc:/medicine/disease:long description\">&nbsp;</div>\r\n<div class=\"m6vS6b PZPZlf\" data-attrid=\"kc:/medicine/disease:long description\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">La enfermedad fue diagnosticada en marzo del 2022.&nbsp;</span></div>\r\n<div class=\"m6vS6b PZPZlf\" data-attrid=\"kc:/medicine/disease:long description\">&nbsp;</div>\r\n<div class=\"m6vS6b PZPZlf\" data-attrid=\"kc:/medicine/disease:long description\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">Comenzo tratamiento psicologico en abril del 2024 teniendo en cuenta que a principio de a&ntilde;o tuvo una crisis de la enfermedad por lo cual se recomendo terapia psicologica para acompa&ntilde;ar psiquicamente y emocionalmente a la paciente con el proceso de su enfermedad.&nbsp;</span></div>\r\n<div class=\"m6vS6b PZPZlf\" data-attrid=\"kc:/medicine/disease:long description\">&nbsp;</div>\r\n<div class=\"m6vS6b PZPZlf\" data-attrid=\"kc:/medicine/disease:long description\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">No puede realizar actividad fisica por el momento.&nbsp;</span></div>\r\n<div class=\"m6vS6b PZPZlf\" data-attrid=\"kc:/medicine/disease:long description\">\r\n<p><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Historia Personal:</strong></span></p>\r\n<ul>\r\n<li style=\"font-family: \'book antiqua\', palatino, serif;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">Antecedentes M&eacute;dicos: No hay antecedentes m&eacute;dicos significativos. A partir del 2022 padece Miastenia Gravis, se realizan estudios medicos constantemente.&nbsp;</span></li>\r\n<li style=\"font-family: \'book antiqua\', palatino, serif;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">Antecedentes Psicol&oacute;gicos: No hay historial de trastornos psicol&oacute;gicos previos. Ha experimentado episodios espor&aacute;dicos de ansiedad, estres, angustia y preocupacion el ultimo tiempo debido a la internacion reciente por su enfermedad por lo cual inicio tratamiento.&nbsp;</span></li>\r\n<li style=\"font-family: \'book antiqua\', palatino, serif;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">Historia Familiar: No hay antecedentes familiares de trastornos psicol&oacute;gicos.</span></li>\r\n</ul>\r\n</div>\r\n<div class=\"m6vS6b PZPZlf\" data-attrid=\"kc:/medicine/disease:long description\">&nbsp;</div>\r\n<div class=\"m6vS6b PZPZlf\" data-attrid=\"kc:/medicine/disease:long description\">&nbsp;</div>\r\n<p>&nbsp;</p>', '12', '2024-04-15 11:46:48'),
(8, 'Gonzalez Priscila', '35851376', '1991-08-02', '2645203327', '<p>Ocupacion: Ama de casa.</p>\r\n<p>Diagn&oacute;stico m&eacute;dico: Fascitis plantar.</p>\r\n<p>Observaciones: Paciente femenino, 32 a&ntilde;os de edad, sin antecedentes patol&oacute;gicos, cursa con pie plano, refiere dolor agudo cuando est&aacute; de pie, por varias horas, motivo por el cu&aacute;l solicita atenci&oacute;n m&eacute;dica y posterior derivaci&oacute;n al servicio de rehabilitaci&oacute;n.</p>\r\n<p>Cantidad desesiones indicadas por el m&eacute;dico:10 sesiones.</p>\r\n<p>Cantidad de sesiones sugeridas por la lic. 15 sesiones.</p>\r\n<h3>Alta kinesica: 19/4/24 (dada de alta m&eacute;dica y kin&eacute;sica.)</h3>', '9', '2024-04-16 09:38:33'),
(9, 'Jofre Delfina', '47285793', '2006-05-16', '2644820088', '<p class=\"MsoNormal\"><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong><span lang=\"ES-AR\">Edad: </span></strong><span lang=\"ES-AR\">17 a&ntilde;os<br><strong>Estado Civil: </strong>Soltera. (No esta de novia ni en una relacion)<br><strong>Convive: </strong>Madre y hermanas (3)<br>Padres separados.<br>Progenitor masculino: Policia retirado.<br>Progenitor Femenino: Profesora de ceramica, realiza talleres.&nbsp;<br><br><strong>Diagnostico: </strong></span></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family: \'book antiqua\', palatino, serif;\"><span lang=\"ES-AR\">Trastorno alimentario.<br><br></span><strong><span lang=\"ES-AR\">Motivo de consulta:</span></strong></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family: \'book antiqua\', palatino, serif;\"><span lang=\"ES-AR\">Derivacion del medico clinico teniendo en cuenta el bajo peso que presenta Jofre Delfina.<br>Inicio tratamiento psicologico comenzando en marzo del ciclo lectivo 2024 asistiendo 1 vez por semana.&nbsp;</span></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family: \'book antiqua\', palatino, serif;\"><span lang=\"ES-AR\">Ultimos analisis realizados con buenos resultados obtenidos.&nbsp;<br>Realiza actividad fisica. Va al gimnasio todos los dias 1 hora por dia. <br></span></span><span lang=\"ES-AR\" style=\"font-family: \'book antiqua\', palatino, serif;\">Actualmente no se encuentra estudiando ninguna carrera universiaria ni trabajando.</span></p>\r\n<p class=\"MsoNormal\"><strong><span lang=\"ES-AR\" style=\"font-family: \'book antiqua\', palatino, serif;\">TTo nutricional:</span></strong></p>\r\n<p class=\"MsoNormal\"><span lang=\"ES-AR\" style=\"font-family: \'book antiqua\', palatino, serif;\">Primera&nbsp; consulta 18.03.24</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"ES-AR\" style=\"font-family: \'book antiqua\', palatino, serif;\">&nbsp;Peso: 42&nbsp; &nbsp; &nbsp;talla: 155</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"ES-AR\" style=\"font-family: \'book antiqua\', palatino, serif;\">IMC: 17.48 BAJO PESO. </span></p>\r\n<p class=\"MsoNormal\"><span lang=\"ES-AR\" style=\"font-family: \'book antiqua\', palatino, serif;\">Consulta:16.04.24</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family: \'book antiqua\', palatino, serif;\"><span lang=\"ES-AR\">Insomio. </span><span lang=\"ES-AR\">amenorrea 1 mes.&nbsp;</span></span></p>\r\n<ul>\r\n<li class=\"MsoNormal\" style=\"font-family: \'book antiqua\', palatino, serif;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">se queda con hambre. y toma agua o infusiones .&nbsp;</span></li>\r\n<li class=\"MsoNormal\" style=\"font-family: \'book antiqua\', palatino, serif;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">Peso actual 43 kg. ( No se pesa en todas las consultas)</span></li>\r\n</ul>\r\n<p><span style=\"font-family: \'book antiqua\', palatino, serif;\">Se solicita realizar un registro de comidas, emociones, ingredientes, porciones, al cual la paciente acepta con estusiamo implementar.&nbsp;</span></p>', '12', '2024-04-16 09:53:47'),
(10, 'Arnaez Valentina', '44916260', '2003-07-27', '2644519172', '<p><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Edad:</strong> 20 a&ntilde;os</span><br><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Estado Civil</strong>: Soltera. </span><br><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Convive: </strong>Con la madre (Policia activa)</span></p>\r\n<p><span style=\"font-family: \'book antiqua\', palatino, serif;\">Se encuentra realizando actualmente el cursillo de medicina.&nbsp;</span></p>\r\n<p><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Motivo de consulta: </strong>Atravezar el proceso de una operaci&oacute;n donde le intervinieron las trompas de falopio a comienzos del 2024, lo cual genero cierta inestabilidad emocional y angustia. Posibilidades de no ser madre.&nbsp;</span><br><span style=\"font-family: \'book antiqua\', palatino, serif;\">Comienza terapia psicologica en febrero del 2024 asistiendo 1 vez por semana y luego cada 15 dias.&nbsp;</span></p>\r\n<p><span style=\"font-family: \'book antiqua\', palatino, serif;\">En el a&ntilde;o 2022 tuvo un accidente de transito.&nbsp;</span></p>\r\n<p><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Historia Personal:</strong></span></p>\r\n<ul>\r\n<li style=\"font-family: \'book antiqua\', palatino, serif;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">Antecedentes M&eacute;dicos: Intervencion quirurgica de trompas de falipio. Ha estado en buen estado de salud f&iacute;sica.</span></li>\r\n<li style=\"font-family: \'book antiqua\', palatino, serif;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">Antecedentes Psicol&oacute;gicos: No hay historial de trastornos psicol&oacute;gicos previos.&nbsp;</span></li>\r\n<li style=\"font-family: \'book antiqua\', palatino, serif;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">Historia Familiar: No hay antecedentes familiares de trastornos psicol&oacute;gicos.</span></li>\r\n</ul>', '12', '2024-04-16 09:58:13'),
(11, 'Mabel Osores', '11296524', '1955-02-22', '2646319029', '<p>Ocupaci&oacute;n: Efectivo policial retirado.</p>\r\n<p>Diagn&oacute;stico: Esclerosis m&uacute;ltiple</p>\r\n<p>Observaciones: Paciete femenino, 69 a&ntilde;os de edad, cursa con esclerosis m&uacute;ltiple desde los 50 a&ntilde;os de edad,se le realizaron estudios en hospital FLENI, donde le diagnostican la enfermedad.</p>\r\n<p>Duraci&oacute;n del tratamiento kinesico seg&uacute;n las indicaciones m&eacute;dicas: por tiempo prolongado, tres veces a la semana.</p>\r\n<p>Alta Kin&eacute;sica</p>\r\n<p>&nbsp;</p>', '9', '2024-04-16 10:35:23'),
(12, 'Vildoso Patricia', '22609790', '1973-03-01', '2644815226', '<p>Paciente en tto desde 29.11.23</p>\r\n<p>Hta, Consumo de antidepresivos.&nbsp; Histerectom&iacute;a. 2 cesarias. Gastritis cr&oacute;nica.&nbsp;</p>\r\n<p>Esguince en julio del 2023 , aumento mucho de peso.</p>\r\n<p>esguince 24 de marzo.&nbsp;</p>\r\n<p>Ultima consulta, 8.03.24 : peso 98 kg&nbsp;</p>\r\n<p>actualmente sin actividad fisica. picoteo nocturno. mucha ansiedad.</p>\r\n<p>Peso actual: 100 kg. Altura 164 cm.&nbsp;</p>\r\n<p>16.04.24: 100 kg. esguince sin act fisica. mucha ansiedad,</p>\r\n<p>13.05.24: paciente psiquiatrico. no duerme bien y come de noche.</p>\r\n<p>sin control come.&nbsp;</p>\r\n<p>te no toma leche porq no compra. no merienda.&nbsp;</p>\r\n<p>99.5 kg.&nbsp; muy dificil el tto.&nbsp;</p>\r\n<p>27.05.24:</p>\r\n<p>act fisica no hace.&nbsp;</p>\r\n<p>99.0 kg.&nbsp;</p>\r\n<p>24.06.24:</p>\r\n<p>gripe. decaida.</p>\r\n<p>act fisica. no hace.</p>\r\n<p>&nbsp;</p>\r\n<p>98.8 kg.&nbsp;</p>\r\n<p>&nbsp;</p>', '14', '2024-04-16 10:50:15'),
(13, 'Alvarez Yamila ', '38217395', '1994-08-05', '2645857000', '<p>Paciente femenino, de 29 a&ntilde;os.&nbsp;</p>\r\n<p>Act f&iacute;sica no realiza.&nbsp;</p>\r\n<p>trabaja de 14 a 18 hs.&nbsp;</p>\r\n<p>Peso inicial 60 kg.&nbsp;</p>\r\n<p>Consulta inicial 21.03.24</p>\r\n<p>Peso 21.03.24: 75.5- altura 155.&nbsp;</p>\r\n<p>16.04.24:&nbsp;</p>\r\n<p>Aumenta caminata + ensalada.&nbsp;</p>\r\n<p>disminuye un poco comida chatarra , toma + agua.&nbsp;</p>\r\n<p>fruta y merienda para el trabajo.,&nbsp;</p>\r\n<p>Peso actual: 73 kg.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', '14', '2024-04-16 11:54:14'),
(14, 'Mesina Ignasio', '44060586', '2002-04-16', '2644830578', '<p><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Edad: </strong>22 a&ntilde;os</span><br><span style=\"font-family: \'book antiqua\', palatino, serif;\">Estudiante de arquitectura. Cursa dias de ma&ntilde;ana y otros de tarde.&nbsp;</span><br><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Convive: </strong>Padres y hermana</span><br><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Padre:</strong> Polic&iacute;a retirado</span><br><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Madre: </strong>Ama de casa<br>Realiza actividad fisica, va al gimansio 3 veces por semana.&nbsp;</span></p>\r\n<p><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Motivo de consulta:&nbsp;</strong></span></p>\r\n<p><span style=\"font-family: \'book antiqua\', palatino, serif;\">Problemas de autoestima, sentimientos de soledad y angustia.<br>Comenzo tratamiento psicologico en noviembre del 2023, continuando en la actualidad con terapia cada 15 o 20 dias.&nbsp;</span></p>\r\n<p><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Historia Personal:</strong></span></p>\r\n<ul>\r\n<li style=\"font-family: \'book antiqua\', palatino, serif;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">Antecedentes M&eacute;dicos: No hay antecedentes m&eacute;dicos significativos. Presenta buen estado de salud f&iacute;sica.</span></li>\r\n<li style=\"font-family: \'book antiqua\', palatino, serif;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">Antecedentes Psicol&oacute;gicos: No hay historial de trastornos psicol&oacute;gicos previos.&nbsp;</span></li>\r\n<li style=\"font-family: \'book antiqua\', palatino, serif;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">Historia Familiar: No hay antecedentes familiares de trastornos psicol&oacute;gicos.</span></li>\r\n</ul>', '12', '2024-04-16 12:07:23'),
(15, 'Reyes Umma', '51004936', '2011-06-16', '2645521888', '<p><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Edad: </strong>13 a&ntilde;os<br></span><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Contextura fisica: </strong>Delgada<br></span><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Estado civil: </strong>Soltera.<br></span><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Escolaridad: </strong>Parroquial Sta. Barbara.</span><br><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>A&ntilde;o: </strong>2do a&ntilde;o de la secundaria, cursando en el turno tarde.<br><strong>Domicilio: </strong>Aberastain entre calle 13 y 14. B&ordm; Don Jose, Barrio 3, casa C. Pocito.&nbsp;&nbsp;</span></p>\r\n<p><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Convive</strong>: Madre, pareja de la madre y su hermano menor de 6 a&ntilde;os.&nbsp;</span><br><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Padres: Separados</strong></span><br><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Progenitor masculino</strong>: Operario de estacion de YPF</span><br><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Progenitor Femenino</strong>: Policia</span></p>\r\n<p><span style=\"font-family: \'book antiqua\', palatino, serif;\">Realiza como deporte jockey sobre cesped desde los 5 a&ntilde;os.&nbsp;</span></p>\r\n<p><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Motivo de consulta:</strong> Autolesiones, ansiedad, complejos con el cuerpo.&nbsp;</span></p>\r\n<p><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Historia Personal:</strong></span></p>\r\n<ul>\r\n<li style=\"font-family: \'book antiqua\', palatino, serif;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">Antecedentes M&eacute;dicos: No hay antecedentes m&eacute;dicos significativos. Ha estado en buen estado de salud f&iacute;sica.</span></li>\r\n<li style=\"font-family: \'book antiqua\', palatino, serif;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">Antecedentes Psicol&oacute;gicos: No hay historial de trastornos psicol&oacute;gicos previos. Ha experimentado episodios espor&aacute;dicos de ansiedad y estr&eacute;s en el ultimo tiempo por lo que se decidio buscar tratamiento.</span></li>\r\n<li style=\"font-family: \'book antiqua\', palatino, serif;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">Historia Familiar: No hay antecedentes familiares de trastornos psicol&oacute;gicos.</span></li>\r\n</ul>\r\n<p style=\"font-family: &quot;book antiqua&quot;, palatino, serif;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">Retoma terapia psicologica en febrero del 2025 para trabajar nuevamente sus emociones y crisis que habria atravesado el ultimo tiempo por situaciones personales.&nbsp;</span></p>\r\n<p style=\"font-family: &quot;book antiqua&quot;, palatino, serif;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">Su padre en la actualidad se encuentra desempleado.&nbsp;</span></p>\r\n<p style=\"font-family: &quot;book antiqua&quot;, palatino, serif;\">&nbsp;</p>', '12', '2024-04-16 12:15:24'),
(16, 'Mariano Tejada', '31523698', '1985-04-21', '2644429605', '<p>Ocupaci&oacute;n: Efectivo policial activo (estafas)</p>\r\n<p>Diagn&oacute;stico m&eacute;dico: post. quir&uacute;rgico de tend&oacute;n de aquiles</p>\r\n<p>Pacientemasculino que asiste al servicio de rehabilitaci&oacute;n, luego de sufrir un traumatismo durante un juego con su hijo, di&oacute; un salto y sinti&oacute; un chasquido, con posterior dolor intenso, e inflamaci&oacute;n, motivo por el cu&aacute;l le colocan un yeso 2 meses y posterior bota walker, por tres semanas.</p>\r\n<p>Cursa actualmemte con rotura de musculo cu&aacute;driceps derecho, previa cirug&iacute;a de menisco, gran debilidad&nbsp; muscular. Inicio de tratamiento 1/3/24.</p>\r\n<p>Cantidad de sesiones indicadas por el m&eacute;dico: cada 15 d&iacute;as debe ir a control y evaluaci&oacute;n m&eacute;dica.</p>\r\n<p>Cantidad de sesiones sugeridas por la lic. dos meses de tratamiento.</p>\r\n<p>Alta kin&eacute;sica:</p>', '9', '2024-04-16 12:16:55'),
(17, 'Paez Guadalupe ', '47891626', '2027-03-27', '2644449530', '<p><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Edad: </strong>17 a&ntilde;os</span><br><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Genero:</strong> Femenino</span><br><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Estado civil: </strong>Soltera</span><br><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Escuela: </strong>San Francisco de Asis.&nbsp;</span><br><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>A&ntilde;o: </strong>6to de la secundaria, cursando en el turno ma&ntilde;ana. <br></span><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Convive: </strong>Padres y hermanas. <br></span><span style=\"font-family: \'book antiqua\', palatino, serif;\">Progenitor masculino: Policia</span><br><span style=\"font-family: \'book antiqua\', palatino, serif;\">Progenitor femenino: Asistente Social.&nbsp;</span></p>\r\n<p><span style=\"font-family: \'book antiqua\', palatino, serif;\">En la actualidad no se encuentra realizando actividad fisica, ni recreativa.&nbsp;</span></p>\r\n<p><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Motivo de Consulta:&nbsp;<br></strong>Test de orientacion voacional.&nbsp;</span></p>\r\n<p><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Historia Personal:</strong></span></p>\r\n<ul>\r\n<li style=\"font-family: \'book antiqua\', palatino, serif;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">Antecedentes M&eacute;dicos: No hay antecedentes m&eacute;dicos significativos. Ha estado en buen estado de salud f&iacute;sica.</span></li>\r\n<li style=\"font-family: \'book antiqua\', palatino, serif;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">Antecedentes Psicol&oacute;gicos: No hay historial de trastornos psicol&oacute;gicos previos.&nbsp;</span></li>\