(18, 'Molla Analia', '29098221', '1981-10-17', '2644109090', '<p><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Edad: </strong>42</span><br><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Estado Civil:</strong> Divorciada</span><br><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Genero: </strong>Femenino</span><br><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Convive: </strong>Con su Hija mujer.&nbsp;</span><br><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Ocupacion:</strong> Nutricionista</span><br><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Lugar de trabajo: </strong>Trabajaba en acondicionamiento Fisico, luego de la suspension por 6 meses fue trasladada al D6 a la escuela de policia donde se encuentra trabajando en la actualidad con horarios rotativos, 1 semana de ma&ntilde;ana y otra de tarde.&nbsp;&nbsp;</span></p>\r\n<p><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Motivo de Consulta:</strong> </span></p>\r\n<p><span style=\"font-family: \'book antiqua\', palatino, serif;\">Derivacion del &aacute;rea Sanidad. Suspension por 6 meses en acondicionamiento fisico.&nbsp;<br>Se solicita realizar tratamiento psicologico al menos por un periodo de&nbsp; aproximadamente 90 dias.&nbsp;</span></p>\r\n<p><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Historia Personal:</strong></span></p>\r\n<ul>\r\n<li style=\"font-family: \'book antiqua\', palatino, serif;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">Antecedentes M&eacute;dicos: No hay antecedentes m&eacute;dicos significativos. Ha estado en buen estado de salud f&iacute;sica.</span></li>\r\n<li style=\"font-family: \'book antiqua\', palatino, serif;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">Antecedentes Psicol&oacute;gicos: No hay historial de trastornos psicol&oacute;gicos 