(19, 'Muggiani Carolina', '26678703', '1978-05-25', '2644152536', '<p><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Edad:</strong> 45</span><br><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Genero: </strong>Femenino</span><br><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Estado Civil</strong>: Casada</span><br><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Ocupacion:</strong> Ama de casa. Anteriormente trabajo en el comercio gran parte de su vida.</span><br><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Convive: </strong>Esposo y dos hijos.</span><br><span style=\"font-family: \'book antiqua\', palatino, serif;\">Su esposo es retirado de la policia y sus hijos estudiantes.</span><br><br><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Motivo de Consulta:</strong> A partir de un infarto que sufre el marido a fines del a&ntilde;o 2023 empezaron a surguir en ella miedos recurrentes.&nbsp;</span><br><span style=\"font-family: \'book antiqua\', palatino, serif;\">Sintomas como angustia, desanimo y paranoia de pensamientos negativos recurrentes.<br>Comenzo tratamiento en marzo del 2024 asistiendo a terapia 1 vez por semana.&nbsp;</span></p>\r\n<p><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Historia Personal:</strong></span></p>\r\n<ul>\r\n<li style=\"font-family: \'book antiqua\', palatino, serif;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">Antecedentes M&eacute;dicos: No hay antecedentes m&eacute;dicos significativos. Ha estado en buen estado de salud f&iacute;sica.</span></li>\r\n<li style=\"font-family: \'book antiqua\', palatino, serif;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">Antecedentes Psicol&oacute;gicos: No hay historial de trastornos psicol&oacute;gicos previos. Primera vez que realiza tratamiento psicologico.&nbsp;</span></li>\r\n<li style=\"font-family: \'book antiqua\', palatino, serif;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">Historia Familiar: No hay antecedentes familiares de trastornos psicol&oacute;gicos.</span></li>\r\n</ul>\r\n<p><br><br></p>', '12', '2024-04-16 12:53:08'),
(20, 'Fonseca Hector', '16384983', '1963-07-25', '2644177050', '<p>Diagn&oacute;stico m&eacute;dico: Sindrome meniscal.</p>\r\n<p>Paciente masculino que asiste al servicio, tras sufrir un traumatismo&nbsp; en su rodilla, refiere dolor, a la observaci&oacute;n presenta inflamaci&oacute;n, fecha de igreso 15/4/24</p>\r\n<p>Ocupaci&oacute;n: Efectivo retirado.</p>\r\n<p>N&uacute;mero de sesiones indicadas por el m&eacute;dico: 10 sesiones y posterior control.</p>\r\n<p>N&uacute;mero de sesiones sugeridos por la licenciada:30 sesiones.</p>\r\n<p>Alta Kin&eacute;sica: 15/5/24</p>', '9', '2024-04-16 13:01:21'),
(21, 'Ligorria Julieta', '55440726', '2016-12-29', '2644123260', '<p>Diagn&oacute;stico m&eacute;dico: Cervicalgia</p>\r\n<p>Paciente femenino que asiste al servicio con s&iacute;ntomas de mareos, dolor, y fatiga muscular de cuello y esc&aacute;pulas.&nbsp;</p>\r\n<p>Ocupaci&oacute;n: estudiante</p>\r\n<p>N&uacute;mero de sesiones indicadas por el m&eacute;dico:10sesiones</p>\r\n<p>N&uacute;mero de sesiones sugeridas por la lic. 15 sesiones.</p>\r\n<h3>Alta kin&eacute;sica: dada de alta kin&eacute;sica.</h3>', '9', '2024-04-16 13:26:45'),
(22, 'FERREYRA LOURDES', '46071476', '2004-10-06', '2645791890', '<p>Paciente que comienza el tratamiento el 24/10/23 peso inicial: 84.000kg. Concurre a la consulta quincenalmente .</p>\r\n<p>16/04/24 peso actual : 78.500 kg ( 5500).&nbsp;</p>', '18', '2024-04-16 19:06:16'),
(23, 'Torres Pablo', '20897741', '1969-10-12', '2644706296', '<p>Diagn&oacute;stico m&eacute;dico: desgarro gemelar de ambos miembros inferiores.</p>\r\n<p>Paciente masculino que asiste con mucho dolor gemelar y molestia en musculo soleo. Fecha de ingreso 10/4/24.</p>\r\n<p>Cantidad de sesiones indicadas porel medico: 10</p>\r\n<p>Cantidad de sesiones sugeridas por la lic.: 15 sesiones.</p>\r\n<p>Alta kin&eacute;sica 1/4/24&nbsp;</p>', '9', '2024-04-17 09:16:53'),
(24, 'Ibaceta Daniela', '26790279', '1978-08-16', '2644394554', '<p>Diagn&oacute;stico m&eacute;dico: Fractura de tobillo izquierdo</p>\r\n<p>Ocupaci&oacute;n: Efectivo policial activo</p>\r\n<p>Paciente femenino, que asiste al servicio con gran inflamacion y cicatriz inmadura, con bota walker y muletas. Ingreso a rehabilitaci&oacute;n el 18/1/24</p>\r\n<p>Cantidad de sesiones indicadas por el m&eacute;dico: tres meses. Luego depender&aacute; de la evoluci&oacute;n del paciente.</p>\r\n<p>Cantidad de sesiones sugeridas por la lic.&nbsp; Tres meses de tratamiento. Teniendo en cuenta la evoluci&oacute;n del caso.</p>\r\n<p>&nbsp;</p>\r\n<p>Dada de alta kin&eacute;sica: 25/4/24</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', '9', '2024-04-17 09:49:17'),
(25, 'Reta Juan', '16183403', '1962-01-06', '2644598017', '<p>Diagn&oacute;stico m&eacute;dico: Debilidad muscular progresiva de ambos MMII.</p>\r\n<p>Paciente masculino que asiste al servicio con imposibilidad para realizar algunos ejercicios de flecci&oacute;n de dedos, elevaci&oacute;n de talones, y gran debilidad al extender rodillas, fecha de ingreso 4/3/24.</p>\r\n<p>Cantidad de sesiones indicadas porel m&eacute;dico: 15</p>\r\n<p>Cantidad de sesiones sugeridas por la lic. 30 sesiones, d&iacute;a por medio.</p>\r\n<p>Alta kin&eacute;sica: 1/5/24 dado de alta</p>', '9', '2024-04-17 09:56:39'),
(26, 'Vega Walter', '38590442', '1995-06-02', '2645866966', '<p>Diagn&oacute;stico m&eacute;dico: postquir&uacute;rgico de fascitis plantar.</p>\r\n<p>Paciente masculino, con ambos pies operados, fecha de ingreso 3/4/24.</p>\r\n<p>Cantidad de sesiones indicadas por el m&eacute;dico: 15 sesiones, con posterior control m&eacute;dico.</p>\r\n<p>Cantidad de sesiones sugridas por la lic. 25 sesiones.</p>\r\n<p>Alta kin&eacute;sica: 4/5/24&nbsp;</p>', '9', '2024-04-17 10:03:12'),
(27, 'Flores Guadalupe', '44915940', '2003-05-21', '2644804666', '<p>Paciente 20 a&ntilde;os.</p>\r\n<p>Asiste desde mayo del 2023.</p>\r\n<p><span style=\"font-family: \'arial black\', sans-serif;\">Diagnostico : </span>Endometrosis. Sobrepeso. Hipotiroidismo</p>\r\n<p><span style=\"font-family: \'arial black\', sans-serif;\">Medicaci&oacute;n : </span>Levotiroxina 50 mg. Dexidex.&nbsp;</p>\r\n<p><span style=\"font-family: \'arial black\', sans-serif;\">Consideraciones generales:&nbsp;</span></p>\r\n<ul>\r\n<li>Menstruaciones irregulares con hemorragias.&nbsp;</li>\r\n<li>Realiza deporte diariamente, de alta intensidad.</li>\r\n<li>Presenta mucho dolor de ovarios e intestinos.</li>\r\n<li>Poco descanso.&nbsp;</li>\r\n</ul>\r\n<p><span style=\"font-family: \'arial black\', sans-serif;\">TTO: </span>dieta completa, adecuada a sintomatologia.&nbsp;</p>\r\n<p>17.04.24: Analisis presentados indican normalidad.</p>\r\n<p>Recordatorio de 24 hs.&nbsp;</p>\r\n<p>d: leche cafe 2 tostadas con huevo.&nbsp;</p>\r\n<p>aL: distribuci&oacute;n del plato.</p>\r\n<p>M: t&eacute; + tostadas o galletas de arroz.</p>\r\n<p>C: Similar almuerzo.</p>\r\n<p>Entrenamiento doble turno: mierc&oacute;les y viernes. ( algunos lunes).</p>\r\n<p>TTO: Peso actual: 80 kg.</p>\r\n<p>% grasa: 46.4%</p>\r\n<p>musculo: 23.2%</p>\r\n<p>09.05.24:&nbsp;</p>\r\n<p>analisis a presentar. resonancia el 24. ( los tiene q traer)</p>\r\n<p>indispuesta 3 dia.&nbsp;</p>\r\n<p>trabaja enla ma&ntilde;ana dia por medio.&nbsp;</p>\r\n<ul>\r\n<li>agarro la bici.</li>\r\n<li>otro curso.&nbsp;</li>\r\n</ul>\r\n<p>te cafe con leche</p>\r\n<p>mas energia . mejor de sintomas intestinales.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>cumple 21 y no tiene mas obra social.&nbsp;</p>', '14', '2024-04-17 10:24:16'),
(28, 'Bazan Antonio', '10684461', '1952-11-11', '2644135389', '<p>Diagnostico m&eacute;dico:Debilidad muscular de MMII.</p>\r\n<p>Paciente masculino que asiste al servicio, con gran debilidad muscular producto de un postquir&uacute;rgico de esciliosis, tuvo un proceso de intrnaci&oacute;n prolongado, e infeccion post. Quir&uacute;rgica. Fecha de ingreso 2/4/24</p>\r\n<p>Ocupacion: Efectivo policial retirado.</p>\r\n<p>Cantidad de sesiones idicadas por el m&eacute;dico:20 sesiones.</p>\r\n<p>Cantidad de sesiones sugeridas por la lic. 20 sesiones, d&iacute;a por medio.</p>\r\n<p>Alta kin&eacute;sica: 2/5/24</p>', '9', '2024-04-17 10:49:16'),
(29, 'Herrera Eves', '6039994', '1955-03-30', '2644161871', '<p>Diagn&oacute;stico m&eacute;dico: sindrome meniscal, artrosis.</p>\r\n<p>Paciente femenina asiste al servicio con gran dolor (gonalgia) de ambas rodillas, con mayor intensidad la derecha, fecha de ingreso 28/3/24</p>\r\n<p>Ocupaci&oacute;n: Ama de casa</p>\r\n<p>Cantidad de sesiones indicadas por el m&eacute;dico: 10 hasta nueva consulta.</p>\r\n<p>Cantidad de sesiones sugeridas por la lic. Depender&aacute; de la evoluci&oacute;n sintom&aacute;tica, y de lo idicado, en cada consulta m&eacute;dica</p>\r\n<p>Alta kin&eacute;sica:&nbsp; 09/08/24 dada de alta por ausencia sin aviso</p>', '9', '2024-04-17 10:56:38'),
(30, 'Arguello Mia ', '46806102', '2005-07-30', '2645319222', '<p><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Edad: </strong>18 a&ntilde;os</span><br><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Estado civil: </strong>Soltera.</span><br><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Direccion; </strong>J.V Gonzalez. Jardin Policiak, 2767</span><br><span style=\"font-family: \'book antiqua\', palatino, serif;\">Estudiante de abogacia.</span><br><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Convive: </strong>Con padres, hermano y abuela.</span><br><span style=\"font-family: \'book antiqua\', palatino, serif;\">Progenitor masculino: Policia</span><br><span style=\"font-family: \'book antiqua\', palatino, serif;\">Progenitor Femenino: Artesana</span></p>\r\n<p><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Motivo de Consulta:</strong></span><br><br><span style=\"font-family: \'book antiqua\', palatino, serif;\">La paciente comenzo terapia psicologica en junio del 2023 por presentar principios de ataques de panico. Actualmente continua con terapia asistiendo cada 20 dias habiendo observado avances y progresos en el tratamiento psicologico.</span></p>\r\n<p><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Historia Cl&iacute;nica:</strong></span></p>\r\n<ul>\r\n<li style=\"font-family: \'book antiqua\', palatino, serif;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">Antecedentes M&eacute;dicos: Presento en su adolescencia temprana problemas alimentarios. No hay antecedentes m&eacute;dicos significativos.</span></li>\r\n</ul>\r\n<ul>\r\n<li style=\"font-family: \'book antiqua\', palatino, serif;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">Antecedentes Psicol&oacute;gicos: No hay historial de trastornos psicol&oacute;gicos previos. Ha experimentado episodios espor&aacute;dicos de ansiedad y estr&eacute;s en el pasado, como crisis de angustia por lo cual inicio tratamiento.</span><br><br></li>\r\n<li style=\"font-family: \'book antiqua\', palatino, serif;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">Historia Familiar: No hay antecedentes familiares de trastornos psicol&oacute;gicos.</span></li>\r\n</ul>', '12', '2024-04-17 11:16:05'),
(31, 'Tapia Maximiliano', '30371308', '1983-09-08', '2644446862', '<p>Diagn&oacute;stico m&eacute;dico: Fractura de tobillo (peron&eacute;) el tratamiento m&eacute;dico fue quir&uacute;rgico, (material de ostesintesis). Fecha de ingreso 8/4/24</p>\r\n<p>Cantidad de sesiones indicadas por el m&eacute;dico:60 sesiones.</p>\r\n<p>Cantidad de sesiones sugeridas porla lic. 60 sesiones.</p>\r\n<p>Alta kin&eacute;sica: depender&aacute; de lo indicado por el m&eacute;dico</p>\r\n<p>Dado de alta</p>', '9', '2024-04-17 11:18:22'),
