(33, 'Jofre Sergio ', '24480424', '1975-03-15', '2645604929', '<p><span style=\"font-family: \'arial black\', sans-serif;\">Edad : </span>49 a&ntilde;os</p>\r\n<p><span style=\"font-family: \'arial black\', sans-serif;\">Diagn&oacute;stico:</span> TG- Colesterolemia- HTA . Dolor de est&oacute;mago recurrente: hernia hiatal. Gastritis cr&oacute;nica, gastritis erosiva, bulbitis.</p>\r\n<p>Act f&iacute;sica: 3 veces por semana . 1 hora.</p>\r\n<p>Primer control: 104</p>\r\n<p><span style=\"font-family: \'arial black\', sans-serif;\">17.04.24</span></p>\r\n<p>primer control: cesa dolor estomacal.</p>\r\n<p>no tiene dolor ni intolerancia con ningun alimento. hace 4 comidas.&nbsp;</p>\r\n<p>peso actual:&nbsp; 102.5 kg.&nbsp;</p>\r\n<p><span style=\"font-family: \'arial black\', sans-serif;\">Control: </span>08.05.24:</p>\r\n<ul>\r\n<li>Sin act fisica:&nbsp; por contractura.&nbsp;</li>\r\n<li>Mal estar no tuvo m&aacute;s.</li>\r\n<li>Leche tostada o te o mate.&nbsp;</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>control peso: 103.5 kg.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', '14', '2024-04-17 12:21:39'),
(34, 'Martinez Ana', '20655165', '1968-09-14', '2644476498', '<p>Diagn&oacute;stico m&eacute;dico: post. Quir&uacute;rgico de sacroleitis y compresi&oacute;n nerviosa (nervio ci&aacute;tico).</p>\r\n<p>Cantidad de sesiones indicadas por el m&eacute;dico: 20 sesiones, luego debe ir a control m&eacute;dico, esperando otra indicaci&oacute;n m&eacute;dica</p>\r\n<p>Cantidad de sesiones sugeridas por las lic. 3 meses de tratamiento</p>\r\n<p>Alta kin&eacute;sica: 1/6/24 dada de alta.</p>', '9', '2024-04-17 12:27:25'),
(35, 'Videla Ismael', '46615518', '2005-04-19', '2645426063', '<p>Diagn&oacute;stico m&eacute;dico:fractura de clav&iacute;cula izquierda</p>\r\n<p>Paciente masculino, cursa con fractura de clav&iacute;cula, fecha de ingreso 15/4/24</p>\r\n<p>Cantidad de sesiones indicadas por el m&eacute;dico: 20 sesiones, hasta control m&eacute;dico.</p>\r\n<p>Cantidad de sesiones sugeridas por la lic. 20 sesiones.</p>\r\n<p>Alta Kin&eacute;sica: 18/06/24 dado de alta</p>', '9', '2024-04-17 12:32:59'),
(36, 'Trigo Eithan', '53364452', '2015-09-14', '2645690224', '<p><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Edad: </strong>8&nbsp;a&ntilde;os</span><br><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Escolaridad:</strong> 3er grado, cursando en el turno tarde.&nbsp;</span><br><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Convive: </strong>Madre y hermanos, siendo el var&oacute;n de 3 hermanos.</span><br><br><span style=\"font-family: \'book antiqua\', palatino, serif;\">Progenitor masculino: Policia</span><br><span style=\"font-family: \'book antiqua\', palatino, serif;\">Progenitor Femenino: Policia&nbsp;</span></p>\r\n<p><strong><span style=\"font-family: \'book antiqua\', palatino, serif;\">Motivo de consulta:&nbsp;</span></strong><br><span style=\"font-family: \'book antiqua\', palatino, serif;\">Derivacion del gabinete del colegio junio del 2023 por presentar atenci&oacute;n l&aacute;bil y dificultades en <span lang=\"ES-AR\">seguir instrucciones, completar tareas escolares y controlar impulsos.&nbsp;<br>En la actualidad continua con el tratamiento psicologico cada 15 d&iacute;as.&nbsp;</span></span></p>\r\n<p><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Diagnostico presuntivo:&nbsp;</strong></span></p>\r\n<ul>\r\n<li style=\"font-family: \'book antiqua\', palatino, serif;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\"><span lang=\"ES-AR\" style=\"font-size: 11pt; line-height: 107%;\">TDHA seg&uacute;n el DSM-5.</span></span></li>\r\n</ul>\r\n<p><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Historia Personal:</strong></span></p>\r\n<ul>\r\n<li style=\"font-family: \'book antiqua\', palatino, serif;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">Antecedentes M&eacute;dicos: No hay antecedentes m&eacute;dicos significativos. Buen estado de salud f&iacute;sica.</span></li>\r\n<li style=\"font-family: \'book antiqua\', palatino, serif;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">Antecedentes Psicol&oacute;gicos: No hay historial de trastornos psicol&oacute;gicos previos.&nbsp;</span></li>\r\n<li style=\"font-family: \'book antiqua\', palatino, serif;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">Historia Familiar: No hay antecedentes familiares de trastornos psicol&oacute;gicos.</span></li>\r\n</ul>', '12', '2024-04-17 13:17:05'),
(37, 'Oyola Héctor', '22011692', '1972-02-23', '2644452303', '<p>50 a&ntilde;os. Masculino. Retirado. No trabaja ni estudia.</p>\r\n<p>Dgto: HTA. ACV 2013 ( con secuelas motrices) . Aumento de gl&oacute;bulos rojos, sin diagnostico preciso.&nbsp;</p>\r\n<p>Medicaci&oacute;n: antidiur&eacute;ticos.&nbsp;</p>\r\n<p>Realiza Act. f&iacute;sico en kinesiolog&iacute;a. Lunes, miercoles, viernes.&nbsp;</p>\r\n<p>Primera consulta: Enero 2023 : 83 kg.</p>\r\n<ul>\r\n<li>d: tostadas + pan lactal +mate +edulcorante</li>\r\n<li>MM: mate</li>\r\n<li>almuerzo:</li>\r\n<li>Merienda:&nbsp; tostadas + mate&nbsp;</li>\r\n<li>Cena:&nbsp;</li>\r\n</ul>\r\n<p>Bebidas:&nbsp; + agua</p>\r\n<p>Peso 17.04.24: 84 kg.&nbsp;</p>\r\n<p>15.05.24: poca agua.</p>\r\n<ul>\r\n<li>poca fruta.</li>\r\n<li>ensalada.&nbsp;</li>\r\n<li>84.5 kg.&nbsp;</li>\r\n</ul>\r\n<p>PA: muy alta la minima. cambia de remedios.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"text-decoration: underline;\">05.06.24:&nbsp; 85 kg.</span></p>\r\n<p>1 enfermo. poca agua.&nbsp;</p>\r\n<ul>\r\n<li>mas fruta y mas verdura.&nbsp;</li>\r\n<li>fruta 1 vez mas.</li>\r\n<li>verduras: 1 vez al dia.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>analisis bien. tg normal.&nbsp; glucemia normal.&nbsp;</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>07.08.24:</p>\r\n<p>agua poco</p>\r\n<p>fruta 1 al dia</p>\r\n<p>sistema de viandas: no saludables.&nbsp;</p>\r\n<p>cena: cualquier cosa.&nbsp;</p>\r\n<p>85.5 kg. +</p>\r\n<p>&nbsp;</p>\r\n<p>11.09.24:</p>\r\n<ul>\r\n<li>mas ensalada.&nbsp;</li>\r\n<li>maneja.&nbsp;</li>\r\n<li>fruta 3 v x semana.&nbsp;</li>\r\n</ul>\r\n<p>agua poco.</p>\r\n<p><strong>84.5 kg.&nbsp;</strong></p>\r\n<p><strong>25.09:</strong></p>\r\n<p><strong>vomito y diarrea la semana pasada.</strong></p>\r\n<p><strong>5 dias diarrea.&nbsp;</strong></p>\r\n<p>82.5 kg. (- 3 kg)&nbsp;</p>\r\n<p>&nbsp;</p>', '14', '2024-04-17 13:23:33'),
(38, 'Elizondo Sofia', '55828135', '2016-10-31', '2645602292', '<p><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Edad:</strong> 7 a&ntilde;os</span><br><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Colegio</strong>: Maria Auxiliadora. Turno ma&ntilde;ana.</span><br><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Convive:</strong> Madre y hermano. Hija menor.</span><br><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Actividades:</strong> Danza dos veces por semana e ingles.</span><br><br><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Motivo de consulta:</strong></span></p>\r\n<p><span style=\"font-family: \'book antiqua\', palatino, serif;\">Derivacion del gabinete de escuela deido a dificultades persistentes en el aprendizaje y en el control de sus impulsos.&nbsp;</span></p>\r\n<p><span style=\"font-family: \'book antiqua\', palatino, serif;\">La paciente comenz&oacute; tratamiento psicologico en abril del 2023 por lo cual este a&ntilde;o continua desde abril con el tratamiento psicologico 1 vez por semana en complento con el area de psicopedagogia.&nbsp;</span></p>\r\n<p><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Diagnostico presuntivo</strong>:</span></p>\r\n<p><span style=\"font-family: \'book antiqua\', palatino, serif;\">Trastorno del aprendizaje.</span></p>\r\n<p><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Historia Personal:</strong></span></p>\r\n<ul>\r\n<li style=\"font-family: \'book antiqua\', palatino, serif;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">Antecedentes M&eacute;dicos: Sobrepeso.</span></li>\r\n<li style=\"font-family: \'book antiqua\', palatino, serif;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">Antecedentes Psicol&oacute;gicos: No hay historial de trastornos psicol&oacute;gicos previos. Ha experimentado episodios espor&aacute;dicos de ansiedad, irritabilidad y angustia en el pasado.</span></li>\r\n<li style=\"font-family: \'book antiqua\', palatino, serif;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">Historia Familiar: No hay antecedentes familiares de trastornos psicol&oacute;gicos.</span></li>\r\n</ul>\r\n<p>&nbsp;</p>', '12', '2024-04-17 13:32:45'),
(39, 'Aroyo Valentino', '49849090', '2009-11-16', '2644394554', '<p><strong>Edad: </strong>14 a&ntilde;os<br><strong>Convive:</strong> Madre, pareja de la madre y su hermano menor.<br>Progenitor Masculino: Mecanico<br>Progenitor femenino: Policia<br>Actividades: Realiza futbol 3 veces por semana y los fines de semana juega partidos.&nbsp;</p>\r\n<p><strong>Motivo de consulta:&nbsp;</strong></p>\r\n<p>Trabajar v&iacute;nculos paternos, problemas de conducta y estado emocional del adolescente.&nbsp;<br>El paciente comienza terapia psicologica en febrero del ciclo lectivo 2024 realizando tratamiento psicologico con una continuidad cada 15 dias.&nbsp;</p>\r\n<p><strong>Historia Personal:</strong></p>\r\n<ul>\r\n<li>Antecedentes M&eacute;dicos: No hay antecedentes m&eacute;dicos significativos. Presenta buena salud.</li>\r\n<li>Antecedentes Psicol&oacute;gicos: No hay historial de trastornos psicol&oacute;gicos previos. Realiza tratamiento desde los 8 a&ntilde;os.&nbsp;</li>\r\n<li>Historia Familiar: Hay antecedentes psicologicos.&nbsp;&nbsp;</li>\r\n</ul>', '12', '2024-04-17 13:42:21');
