(40, 'Pave Elisa', '57721296', '2015-08-10', '2646255963', '<p><span style=\"font-family: \'book antiqua\', palatino, serif; font-size: 10pt;\"><strong>Edad:</strong> 8 a&ntilde;os</span><br><span style=\"font-family: \'book antiqua\', palatino, serif; font-size: 10pt;\"><strong>Convive:</strong> Padre y abuelos.</span><br><span style=\"font-family: \'book antiqua\', palatino, serif; font-size: 10pt;\"><strong>Escolaridad: </strong>Turno tarde. 4to grado de la primaria.&nbsp;</span></p>\r\n<p><strong><span style=\"font-family: \'book antiqua\', palatino, serif; font-size: 10pt;\">Motivo de consulta:&nbsp;</span></strong></p>\r\n<p><span lang=\"ES-AR\" style=\"font-size: 10pt; line-height: 107%; font-family: \'book antiqua\', palatino, serif;\">La ni&ntilde;a ha sido referida al tratamiento psicol&oacute;gico en abril del a&ntilde;o 2023 asistiendo a terapia 1 vez por semana con el prop&oacute;sito de abordar su estado emocional, mejorar sus habilidades sociales y evaluar su estado ps&iacute;quico habiendo experimentado y vivenciado situaciones de violencia f&iacute;sica y verbal por parte de la figura materna.</span></p>\r\n<p><span lang=\"ES-AR\" style=\"font-size: 10pt; line-height: 107%; font-family: \'book antiqua\', palatino, serif;\">En la actualidad continua conn tratamiento psicologico cada 15 dias pudiendo haber observando avances positivos en la misma.&nbsp;</span></p>\r\n<p><span style=\"font-family: \'book antiqua\', palatino, serif; font-size: 10pt;\"><strong>Historia Personal:</strong></span></p>\r\n<ul>\r\n<li style=\"font-family: \'book antiqua\', palatino, serif; font-size: 10pt;\"><span style=\"font-family: \'book antiqua\', palatino, serif; font-size: 10pt;\">Antecedentes M&eacute;dicos: No hay antecedentes m&eacute;dicos significativos. Ha estado en buen estado de salud f&iacute;sica.</span></li>\r\n<li style=\"font-family: \'book antiqua\', palatino, serif; font-size: 10pt;\"><span style=\"font-family: \'book antiqua\', palatino, serif; font-size: 10pt;\">Antecedentes Psicol&oacute;gicos: A partir de su conducta y caracteristicas que manifestaba la misma se busc&oacute; realizar tratamiento.</span></li>\r\n<li style=\"font-family: \'book antiqua\', palatino, serif; font-size: 10pt;\"><span style=\"font-family: \'book antiqua\', palatino, serif; font-size: 10pt;\">Historia Familiar: No hay antecedentes familiares de trastornos psicol&oacute;gicos.</span></li>\r\n</ul>\r\n<p>&nbsp;</p>', '12', '2024-04-17 13:50:31'),
(41, 'Urbano Ruben ', '25939725', '1968-05-15', '2644106899', '<p><strong><span style=\"font-family: \'book antiqua\', palatino, serif;\">Edad:</span></strong><br><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Estado Civil:</strong> Casado</span><br><strong><span style=\"font-family: \'book antiqua\', palatino, serif;\">Jerarquia:</span></strong><br><span style=\"font-family: \'book antiqua\', palatino, serif;\">Actualmente vive solo.</span></p>\r\n<p><strong><span style=\"font-family: \'book antiqua\', palatino, serif;\">Motivo de consulta:&nbsp;</span></strong></p>\r\n<p><span style=\"font-family: \'book antiqua\', palatino, serif;\">Trabajar su estado emocional. Presentaba constante angustia en diciembre del 2023 cuando comenzo con tratamiento psicologico 1 vez por semana siendo que en la actualidad continua con el tratamiento cada 15 d&iacute;as.&nbsp;</span></p>\r\n<p><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Historia Personal:</strong></span></p>\r\n<ul>\r\n<li style=\"font-family: \'book antiqua\', palatino, serif;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">Antecedentes M&eacute;dicos: No hay antecedentes m&eacute;dicos significativos. Ha estado en buen estado de salud f&iacute;sica.</span></li>\r\n<li style=\"font-family: \'book antiqua\', palatino, serif;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">Antecedentes Psicol&oacute;gicos: No hay historial de trastornos psicol&oacute;gicos previos. Ha experimentado episodios espor&aacute;dicos de ansiedad y estr&eacute;s en el pasado, pero nunca busc&oacute; tratamiento.</span></li>\r\n<li style=\"font-family: \'book antiqua\', palatino, serif;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">Historia Familiar: No hay antecedentes familiares de trastornos psicol&oacute;gicos.</span></li>\r\n</ul>', '12', '2024-04-17 13:54:34'),
