(82, 'Cecco Elizondo Luigui', '48148802', '2007-08-13', '2644323259', '<p><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Edad:</strong> 16 a&ntilde;os</span><br><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Escuela:</strong> Boero Epet. N&ordm; 1</span><br><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Convive: </strong>Con abuelos y primo</span><br><span style=\"font-family: \'book antiqua\', palatino, serif;\">Ambos padres fallecieron</span><br><span style=\"font-family: \'book antiqua\', palatino, serif;\">Madre padecia cancer y el padre diabetes.&nbsp;</span></p>\r\n<p><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Diagnostico:</strong></span></p>\r\n<p><span style=\"font-family: \'book antiqua\', palatino, serif;\">Trastorno de la conducta. Trastorno generalizado del desarrollo.&nbsp;</span></p>\r\n<p><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Motivo de consulta:&nbsp;</strong></span></p>\r\n<p><span style=\"font-family: \'book antiqua\', palatino, serif;\">Realizar evaluacion psicologica en abril del 2024 para poder complementar su historia clinica.&nbsp;</span></p>\r\n<p><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Historia Personal:</strong></span></p>\r\n<ul>\r\n<li style=\"font-family: \'book antiqua\', palatino, serif;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">Antecedentes M&eacute;dicos: No hay antecedentes m&eacute;dicos significativos. Ha estado en buen estado de salud f&iacute;sica.</span></li>\r\n<li style=\"font-family: \'book antiqua\', palatino, serif;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">Antecedentes Psicol&oacute;gicos: Hay historial de trastornos psicol&oacute;gicos previos. El paciente presenta carnet de discapacidad el cual se vence el 26 de enero del 2025.&nbsp;</span></li>\r\n<li style=\"font-family: \'book antiqua\', palatino, serif;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">Historia Familiar: No hay antecedentes familiares de trastornos psicol&oacute;gicos.</span></li>\r\n</ul>', '12', '2024-04-19 10:49:12'),
(83, 'Abrevalo Mirta', '10637208', '1952-09-15', '2644402598', '<p><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Edad: </strong>71 a&ntilde;os</span><br><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Genero:</strong> Femenino</span><br><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Estado Civil:</strong> viuda</span><br><span style=\"font-family: \'book antiqua\', palatino, serif;\">4 hijos</span><br><span style=\"font-family: \'book antiqua\', palatino, serif;\">Vive sola&nbsp;</span><br><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Ocupacion:</strong> Jubilada de la clinica de traumatologia.</span><br><br><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Motivo de consulta:</strong></span></p>\r\n<p><span style=\"font-family: \'book antiqua\', palatino, serif;\">Busca ayuda psicologica con el fin de realizar tratamiento para abordar y elaborar el duelo por el fallecimiento de su marido quien fallece en marzo del 2023. Iniciando tratamiendo psicologico en diciembre del 2023 una vez por semana. En la actualidad asiste a sesiones de psicologia cada 15 dias.&nbsp;</span></p>\r\n<p><span style=\"font-family: \'book antiqua\', palatino, serif;\"><strong>Historia Personal:</strong></span></p>\r\n<ul>\r\n<li style=\"font-family: \'book antiqua\', palatino, serif;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">Antecedentes M&eacute;dicos: No hay antecedentes m&eacute;dicos significativos. Ha estado en buen estado de salud f&iacute;sica.</span></li>\r\n<li style=\"font-family: \'book antiqua\', palatino, serif;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">Antecedentes Psicol&oacute;gicos: No hay historial de trastornos psicol&oacute;gicos previos. Ha experimentado episodios espor&aacute;dicos de ansiedad y angustia teniendo en cuenta lo vivenciado en el ultimo tiempo.&nbsp;</span></li>\r\n<li style=\"font-family: \'book antiqua\', palatino, serif;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">Historia Familiar: Hay antecedentes familiares de trastornos psicol&oacute;gicos.</span></li>\r\n</ul>', '12', '2024-04-19 10:54:35'),
(84, 'Galian Monica', '25988016', '1977-07-03', '26444422957', '<p>Paciente femenino. Policia en proceso de retiro.</p>\r\n<p>Edad;: 46 a&ntilde;os.&nbsp;</p>\r\n<p>Primera consulta: 02.02.24&nbsp;</p>\r\n<p>Dtgo: SIBO- gastritis cr&oacute;noca.&nbsp;</p>\r\n<p>Se realiza dieta FODMAPS . Con introduccion alimentaria acorde a tolerancia.</p>\r\n<p>Mejora sintomas.</p>\r\n<p>Manifiesta mejorar su desarrollo de masa muscular, por lo q se indica dieta normocalorica levemente hiperproteica.</p>\r\n<p>&nbsp;</p>\r\n<p>PEso primera consulta 59.2 altura 1.64&nbsp;</p>\r\n<p>Masa grasa: 35.2 % muscular 25.6 % Grasa visceral : 5 IMC: 22.3</p>\r\n<p>29.02. Peso: 58.3</p>\r\n<p>10.03 : Grasa: 32.3%</p>\r\n<p>Masa muscular:27.5%</p>\r\n<p>Grasa visceral: 5</p>', '14', '2024-04-19 11:35:18'),
