(119, 'Cabrera Dario ', '26611525', '1978-06-07', '2644640932', '<p>Paciente masculino. 45 a&ntilde;os.</p>\r\n<p>Esteatosis hepatica grado II</p>\r\n<p>F&iacute;stula intestinal.&nbsp;</p>\r\n<p>Inicia tto junio del 2023. 108 kgs.</p>\r\n<p>ultima consulta marzo 2024: 100.5 kg.&nbsp;</p>\r\n<ul>\r\n<li>25.04.23:&nbsp; 101.5 kg.&nbsp;</li>\r\n</ul>\r\n<p>25.06.24: act fisica no.</p>\r\n<p>trabaja ma&ntilde;an y tarde.</p>\r\n<p>104 kg</p>\r\n<p>marzo hasta ahora subio 4 kg.&nbsp;</p>', '14', '2024-04-25 08:22:48'),
(120, 'Correa Lurdes', '43488746', '2002-06-03', '26445322942', '<p>Paciente femenino de 23 a&ntilde;os. Padre policia.</p>\r\n<p>Estudia y trabaja .&nbsp;</p>\r\n<p>Vive con su mama. No toma medicaci&oacute;n ni padece ninguna enfermedad cr&oacute;nica.</p>\r\n<p>Entrena 3 a 5 veces por semana. Musculaci&oacute;n. Hace aproxmente 6 meses.</p>\r\n<p>Analisis normales, no tiene hijos ni embarazos.</p>\r\n<p>Inicio del tto ; marzo 2024.&nbsp;</p>\r\n<p>Peso: 97 kg. Grasa 51.5 % Muscular: 20.7 %&nbsp; VF:7&nbsp; altura : 1.69</p>\r\n<p>Dgto: obesidad.</p>\r\n<p>3.04: Segundo control: 96.4 Kg. - 600 grs.</p>\r\n<p>25.04.24&nbsp;</p>\r\n<p>Dejo de entrenar 3 semanas .&nbsp;</p>\r\n<p>y volvio.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Peso actual: 96</p>\r\n<p>Grasa 51.2 % 20.9 %muscular VF: 7&nbsp;</p>\r\n<p>21.05.24:</p>\r\n<ul>\r\n<li>Entreno todos los dias.&nbsp;</li>\r\n<li>menstruacion . muchos dias de menstruacion.&nbsp;</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>22- 169 96</li>\r\n<li>51.1</li>\r\n<li>mus: 21</li>\r\n<li>7</li>\r\n<li>IM_C: 33</li>\r\n</ul>\r\n<p>10.06.24:</p>\r\n<p>23 a&ntilde;os.</p>\r\n<p>faringitis 4 dias en cama. 1 semana comio poco por dolor</p>\r\n<p>la semana anterior si comio mal.</p>\r\n<p>23 a&ntilde;os.</p>\r\n<p>94.5 kg.&nbsp;</p>\r\n<p>50.2 gr</p>\r\n<p>musc: 20.6</p>\r\n<p>&nbsp;</p>\r\n<p>02.07.24 :&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>empezo funcional. poco entrenamiento.&nbsp;&nbsp;</p>\r\n<p>95.5 kg.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>15.08:&nbsp;</p>\r\n<p>empezo el lunes crosfit personalizado.&nbsp;</p>\r\n<p>168 colet.</p>\r\n<p>16.05 insulina</p>\r\n<p>gl: 77&nbsp;</p>\r\n<p>95.5 kg.</p>\r\n<p>gr49.7</p>\r\n<p>&nbsp;mm: 21</p>\r\n<p>gv: 7&nbsp;</p>\r\n<p>29.08.24</p>\r\n<ul>\r\n<li>act fisica poca.</li>\r\n<li>17 a&ntilde;os fuma ahora fuma mucho.</li>\r\n<li>&nbsp;</li>\r\n</ul>', '14', '2024-04-25 09:21:02'),
(121, 'Montaña Jorge', '10999679', '1953-11-21', '2644749679', '<p>Diagn&oacute;stico: Debilidad muscular generalizada, paciente que cursa con hipocondr&iacute;a, Artrosis, fecha de comienzo 23/4/24, ya realiz&oacute; sesiones anteriormente por otro diagn&oacute;stico.</p>\r\n<p>Cantidad de sesiones idicadas por el m&eacute;dico: 10 sesiones, hasta nuevo control.</p>\r\n<p>Cantidad de sesiones indicadas por la lic. Un mes.</p>\r\n<p>Alta kin&eacute;sica: 23/5/25.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', '9', '2024-04-25 10:19:39'),
(122, 'Molina Juan Manuel', '31870990', '1987-02-05', '2645844390', '<p>Paciente de 37 a&ntilde;os.</p>\r\n<p>Con dgto de obesidad.&nbsp;</p>\r\n<p>No refiere patologia previa ni toma de medicaci&oacute;n cr&oacute;nica.&nbsp;</p>\r\n<p>Malos habitos alimentarios y sedentarismo. Esteatosis moderada.&nbsp;</p>\r\n<p>Peso: 96- 1.71 cm.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>25.04.24: 89.5 kg.&nbsp;</p>\r\n<p>10.05.24 : dejo ac fisica,</p>\r\n<p>mas agua.</p>\r\n<p>38 a&ntilde;os. 10.05: 88 kg.&nbsp;</p>\r\n<p>31.9%</p>\r\n<p>32.0</p>\r\n<p>GV: 8</p>\r\n<p>IMC: 30.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>31.05.24:&nbsp;</p>\r\n<p>menos hidrat no act fisicia.</p>\r\n<p>88.7&nbsp; kg.&nbsp;</p>', '14', '2024-04-25 10:29:42'),
(123, 'Jofre Delfina', '47285793', '2006-05-16', '2644820088', '<p>17 a&ntilde;os. TCA</p>\r\n<p>intolerancia a la lactosa.</p>\r\n<p>Peso: 48 . ( aumento de peso 1 kg desde q empezo el tto)&nbsp;</p>\r\n<p>supl: B12</p>\r\n<p>entrena todos los dias.&nbsp;</p>\r\n<p>musculacion.&nbsp; te o mate cocido:</p>\r\n<p>no quiso realizar control o registro de comidas.&nbsp;</p>\r\n<ul>\r\n<li>mejora insomnio.&nbsp;</li>\r\n<li>&nbsp;</li>\r\n</ul>\r\n<p>13.05.24:&nbsp;</p>\r\n<p>27.05.24:&nbsp;</p>\r\n<p>desganada . va a hacer registro</p>\r\n<p>manifiesta q esta resfriada y se siente mal.&nbsp; ansiosa por empezar el curso de maquillaje</p>\r\n<p>muy pocas ganas&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>10.06.24: HICIMOS registro</p>\r\n<p>25.06.24:</p>\r\n<p>&nbsp;</p>\r\n<p>enferma resfrio.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>onflamada c leche o queso.</p>\r\n<p>29.07.24:&nbsp;</p>\r\n<p>50 kg.&nbsp;</p>\r\n<p>12.08:&nbsp;</p>\r\n<p>nota algun cambio.&nbsp;</p>\r\n<ul>\r\n<li>siente qpuede hacer menos ejercicio.</li>\r\n<li>&nbsp;</li>\r\n</ul>', '14', '2024-04-25 11:12:14'),
(124, 'Jopia Micaela ', '38075506', '1994-03-06', '26405431009', '<p>Edad 30<br>Sexo: Femenino<br>Jerarquia: Cabo&nbsp;<br>Estado civil: Soltera<br>Trabaja en criminalistica<br>Estudia la tecnicatura de criminologia<br>Convive: Con su hijo</p>\r\n<p>Motivo de Consulta:</p>\r\n<p>Micaela empieza terapia psicologica en marzo del 2023 por propia voluntad a fin de resolver problemas de autoestima, sentimientos de inseguridad, baja tolerancia a la frustracion a raiz de haberse separado de su pareja en ese momento, realizando terapia durante 1 a&ntilde;os.&nbsp;</p>\r\n<p>En marzo del 2024 la paciente deja de asistir presentando confusiones con los turnos, luego olvidandose de ellos hasta que por ultimo dejo colgado el ultimo turno que se le dio en marzo sin dar previo aviso que dejaria de asistir a las sesiones de psicologia.</p>\r\n<p>Ultimos dias de septiembre la paciente se vuelve a comunicar con la terapeuta para retomar terapia nuevamente, donde en octubre del presente a&ntilde;o retoma las sesiones considerando que seria oportuno que comience 1 vez por semana nuevamente ya que, la misma presentaria varios sintomas de principios de una&nbsp; depresion pudiendo estar desarrollando un trastorno del estado del animo.</p>\r\n<p>En el dia de la fecha 12/11/2024 la paciente se ausenta al turno asignado en la sesion anterior y no informa de que no asistiria al encuentro terapeutico.&nbsp;</p>\r\n<p>El dia 09/01/2025 la paciente consulta el mismo dia del turno cuando debia asistir informandole que ese mismo dia a las 12:00hs donde la misma informa que si se le puede modificar el turno ya que no llegaria, a lo cual se le otorga nuevamente el dia 13/01/2025 confirmando que asistiria a las 12:00hs nuevamente. LLegado el dia la paciente no se presenta y no da aviso tampoco de que no asistiria nuevamente al turno otorgado, pudiendo notar nuevamente inestabilidad en la misma y falta de compromiso para con la terapia como gran desorganizacion.&nbsp;</p>', '12', '2024-04-25 11:34:44'),
(125, 'Ortiz Jose', '14210445', '1963-03-19', '2644717985', '<p>Diagn&oacute;stico: Lumbalgia</p>\r\n<p>Observaciones: Paciente que ingresa el d&iacute;a 24/4/24, es efectivo policial retirado.</p>\r\n<p>Cantidad de sesiones indicadas por el m&eacute;dico: 10 sesiones.</p>\r\n<p>Cantidad de sesiones sugeridas por ka lic. 10 sesiones.</p>\r\n<p>Alta kin&eacute;sica:4/5/24</p>', '9', '2024-04-25 11:46:05'),
(126, 'Castro José', '25195303', '1975-03-05', '2645410659', '<p>Paciente de 47 a&ntilde;os. Retirado.</p>\r\n<p>Asiste a consulta por primera vez&nbsp; el 10.04.23, ya que inicia act. f&iacute;sica de forma intensa ( ciclismo) y desea bajar grasa y aumentar masa muscular.</p>\r\n<p>coleterolemia leve.</p>\r\n<p>88.5&nbsp; 1.74 grasa: 28.3 musculo: 33.3 grasa visceral 13.</p>\r\n<p>Ultimo control: Marzo 24&nbsp;</p>\r\n<p>Peso: 83 kg ( en diciembre dejo con un peso de 79 kg)&nbsp;</p>\r\n<p>Grasa: 31 musculo: 30.9 Grasa visceral 7</p>\r\n<p>Se evalua nivel de act fisica y suplementaci&oacute;n acorde.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', '14', '2024-04-25 12:18:01'),
(127, 'Ester Pérez', '28720440', '1981-04-05', '2644683791', '<p>Paciente femenino. Ama de casa. esposa de policia</p>\r\n<p>5 hijos, poco nivel de act fisicia</p>\r\n<p>Comienza a realizar ciclismo, de forma recreativa 2 a 3 v x semana, no de forma constante.&nbsp;</p>\r\n<p>Priemra consulta junio del 23.</p>\r\n<p>con un peso de 72 kg. altura: 154</p>\r\n<p>Grasa: 45.3</p>\r\n<p>musc: 23. vf:8&nbsp;</p>\r\n<p>Ultima consulta: marzo 23 Peso: 69.3&nbsp;</p>\r\n<p>Grasa 41.8 musculo:25.1 VF: 8&nbsp;</p>', '14', '2024-04-25 12:22:11'),
