(129, 'TEJADA KEILA', '46726300', '0001-01-01', '2644836536', '<p>PACIENTE QUE INGRESA EL 27/02 CON UN PESO DE : 66.6 KG SE LE INDICA PLAN DE INICIO Y RECETAS AL PLAN.&nbsp;</p>\r\n<p>MOTIVO DE CONSULTA: ORGANIZAR SU ALIMENTACION . COLON IRRITABLE.</p>\r\n<p>SEGUNDO CONTROL PESO: 66.1 MEJORO SU IRRITABILIDAD INTESTINAL, SE INDICA EL MISMO PLAN.&nbsp;</p>', '18', '2024-04-25 15:39:04'),
