(137, 'Olivera Julio ', '17650424', '1966-07-29', '26444600581', '<p>Paciente masculino, retirado. de 57 a&ntilde;os.&nbsp;</p>\r\n<p>Asiste a la primera consulta el dia 16.01.24con diagnostico de hta. insulino resistencia. colesterolemia y uricemia.</p>\r\n<p>Peso: 124 kg.&nbsp;</p>\r\n<p>Asiste a control cada 15 d&iacute;as. con un adherencia al tto adecuada.&nbsp;</p>\r\n<p>26.04.24:Peso actual :110kg.</p>\r\n<p>Analisis pendientes de revisi&oacute;n.&nbsp;</p>\r\n<p>17.05.24: 107.8 kg.&nbsp;</p>\r\n<p>analisis de carga de glucemia: muy bien.&nbsp;</p>\r\n<p>Gl basal: 0.86</p>\r\n<p>60 m: 1.18</p>\r\n<p>120: 0.96</p>\r\n<p>04.07.24:&nbsp;</p>\r\n<p>poca act fisica.&nbsp;</p>\r\n<p>106.2 kg.&nbsp;</p>\r\n<p>09.08.24: no hace act fisica.</p>\r\n<p>58 a&ntilde;os.</p>\r\n<p>*- 110.2 kg.&nbsp;</p>\r\n<p>desde 2.06 : sin act fisica</p>\r\n<p>06.09.24</p>\r\n<p>-110.5 kg.&nbsp;</p>\r\n<p>&nbsp;</p>', '14', '2024-04-26 08:51:10'),
