(139, 'Torres Carlos', '21742777', '1972-02-08', '2645857985', '<ul>\r\n<li>Retirado. 53 a&ntilde;os. acude a consulta en agosto del 2023, derivado por higado graso tipo II.</li>\r\n</ul>\r\n<p>Litiasis m&uacute;ltiple y meteorismo. gastritis.&nbsp;</p>\r\n<p>Analisis refieren tb una glucemia de 103 . leve sobrepeso</p>\r\n<p>Peso 76 kg.altura 170 IMC: 26</p>\r\n<p>26.04.24 dejo act fisica. por problemas familiares.</p>\r\n<p>70.5 kg.&nbsp;</p>\r\n<p>Control: 17.05.24:&nbsp;</p>\r\n<p>4- 5 dias por semana. musculacion. volvio.</p>\r\n<p>`* huevo todos los dias.</p>\r\n<ul>\r\n<li>sin sintomas.&nbsp;</li>\r\n</ul>\r\n<p>peso: 70.9</p>\r\n<p>fat: 26.4%&nbsp; musd: 32.5%</p>\r\n<p>vf: 10 IMC: 24.5.</p>\r\n<p>&nbsp;</p>\r\n<p>12.06.24 :</p>\r\n<p>una semana sin act fisica.&nbsp;</p>\r\n<p>enfermo.&nbsp;</p>\r\n<p>poca agua.&nbsp;</p>\r\n<p>verduras: si fruta: 1 x dia.&nbsp;</p>\r\n<p>peso: 70.7&nbsp;</p>\r\n<p>gr: 25.4</p>\r\n<p>mm: 33%</p>\r\n<p>gv: 9&nbsp;</p>\r\n<p>imc: 23.</p>\r\n<p>&nbsp;</p>\r\n<p>10.07.24 :&nbsp;</p>\r\n<p>3 semanas sin gimnasio.</p>\r\n<p>Enfermo.</p>\r\n<p>4 vx semana.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>53 a&ntilde;os.</p>\r\n<p>170 cm.&nbsp;</p>\r\n<p>71.5&nbsp;</p>\r\n<p>gr: 24.6</p>\r\n<p>mm: 33.8</p>\r\n<p>gv: 9</p>\r\n<p>imc 24.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>07.08.24:&nbsp;</p>\r\n<p>sigue cuidando.</p>\r\n<p>4 v x semanas . gimnasia.</p>\r\n<p>73 kg</p>\r\n<p>gr: 24.9</p>\r\n<p>mm: 33.9</p>\r\n<p>grv: 9.</p>\r\n<p>04.09.24:&nbsp;</p>\r\n<p>act fisica : gimnasio.</p>\r\n<p>170/ 54</p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>71.5</li>\r\n<li>gr: 24.7</li>\r\n<li>mm: 33.9</li>\r\n<li>GRv: 9</li>\r\n</ul>\r\n<p>&nbsp;</p>', '14', '2024-04-26 11:53:11'),
(140, 'Fernandez M. Jose ', '45264226', '2003-10-02', '2645762074', '<p>Paciente femenino. 20a&ntilde;os. Padre policia retirado.</p>\r\n<p>Estudiante de bioquimica. Cursa todos los d&iacute;as.</p>\r\n<p>No realiza actualmente act fisica</p>\r\n<p>Obj del tto: aumento de masa muscular.</p>\r\n<p>Plan: hiperproteico -hipercal&oacute;rico.</p>\r\n<p>Primera toma de mediciones : 03.04.24</p>\r\n<p>46.5 peso. Talla 1.64</p>\r\n<p>Grasa: 46.5 %&nbsp; MM: 26.8%&nbsp; VF: 2 IMC 18.5</p>\r\n<p>Segundo control: ( Indispuesta dia 1)&nbsp;</p>\r\n<p>Peso 47.7&nbsp; Grasa: 26.7 MM: 27.4% VF : 2 IMC 18.9</p>\r\n<p>23.05.24 : 47 kg.</p>\r\n<p>grasa: 24.7%</p>\r\n<p>MM:27.4%</p>\r\n<p>VF: 2 IMC: 19</p>\r\n<p>12.07.24</p>\r\n<p>47.4</p>\r\n<p>PESO:</p>\r\n<p>GR: 23.8</p>\r\n<p>MM:28.2</p>\r\n<p>IMC:18</p>\r\n<p>&nbsp;</p>', '14', '2024-04-26 13:21:27'),
(141, 'Fernandez Quimey ', '43221576', '2001-02-08', '264546297', '<p>Paciente femenino. 23 a&ntilde;os. estudiante de psicopedagog&iacute;a.&nbsp;</p>\r\n<p>Mediacion cronica: T4 ( Hace 2 a&ntilde;os)</p>\r\n<p>Act fisica no actualmente.</p>\r\n<p>Objetivo: aumentar masa muscular</p>\r\n<p>Plan hipercal&oacute;rico hiperproteico.</p>\r\n<p>Primer control: 3.04.24 :</p>\r\n<p>Peso:&nbsp; 49 / Talla 157&nbsp; Gr: 29.9 % MM: 26.3&nbsp; VF: 3 IMC: 20</p>\r\n<p>Segundo control: 26.04.24&nbsp; Peso: 49</p>\r\n<p>grasa: 29.8 %&nbsp; musc: 26.4 %&nbsp; VF: 3&nbsp;</p>\r\n<ul>\r\n<li>23.05.24: volvio hace 15&nbsp; dias a crosfit.&nbsp; entrena tipo 4 o 7</li>\r\n</ul>\r\n<p>kg: 49.5</p>\r\n<p>28.4</p>\r\n<p>29% . vg: 3</p>\r\n<p>vf: 3&nbsp;</p>\r\n<p>12.07.24:</p>\r\n<p>50.5</p>\r\n<p>GR: 27.6%</p>\r\n<p>MM: 29.7</p>\r\n<p>V: 3</p>', '14', '2024-04-26 13:26:19'),
