(146, 'Ovallez Alexander', '43220825', '2001-02-07', '2644441021', '<p>Edad: 23 a&ntilde;os<br>Domicilio: Salvador Villa el carril 235 (e) Pocito.<br>jerarquia: Agente<br>Convive en la actualidad 2025 con su esposa e hija de su pareja.&nbsp;<br>Trabaja: Escuela de musica.&nbsp;</p>\r\n<p><strong>Motivo de consulta:</strong></p>\r\n<p>Ansiedad, dificultad en la relacion con su pareja actual.</p>\r\n<p>Alexander asisito a terapia psicologica por cuenta propia a fines de a&ntilde;o de 2023 (octubre)<br>El mismo realizo terapia de manera continua asistiendo en forma y tiempo hasta mediados de a&ntilde;o del 2024, luego empezo en agosto a tener complicaciones para asistir, sacando turno y luego no presentarse al encuentro, no avisando o avisando dias despues de que no habia podido acudir por tal motivo. MAyo del presente a&ntilde;o 2025 el mismo solicita nuevamente un turno al cual acude en forma y tiempo pero luego a la proxima sesion no avisa y no se presenta por tal motivo y de reiteradas faltas se considera oportuno brindarle el lugar a otro afiliado que se encuentre en lista de espera. (mayo 15 del 2025)</p>', '12', '2024-04-29 08:32:57'),
