(224, 'Ontiveros Alma', '57775644', '2019-01-07', '2644105497', '<p><span style=\"font-family: \'book antiqua\', palatino, serif;\">Edad: 4 a&ntilde;os</span><br><span style=\"font-family: \'book antiqua\', palatino, serif;\">Genero: Femenino</span><br><span style=\"font-family: \'book antiqua\', palatino, serif;\">Asiste al jardin de 4 en el turno tarde.</span><br><span style=\"font-family: \'book antiqua\', palatino, serif;\">Convive: Madre</span><br><br></p>\r\n<p><span style=\"font-family: \'book antiqua\', palatino, serif;\">Motivo de consulta:</span></p>\r\n<p><span style=\"font-family: \'book antiqua\', palatino, serif;\">Se sugiere terapia psicologica para abordar con la infante la separacion de sus progenitores, como trabajar problemas de conducta que estaria presentado la peque&ntilde;a a raiz de la situacion mencionada anteriormente y por ello a traves del tratamiento desarrollar la tolerancia a la frustracion, desarrollar la capacidad de espera como tambien brindarle herramientas a los padres para trabajar con la misma tanto en el contexto familiar como escolar.&nbsp;</span></p>\r\n<p><span style=\"font-family: \'book antiqua\', palatino, serif;\">Antecedentes:&nbsp;</span></p>\r\n<ul>\r\n<li style=\"font-family: \'book antiqua\', palatino, serif;\"><span style=\"font-family: \'book antiqua\', palatino, serif;\">Sobrepeso&nbsp;</span></li>\r\n</ul>', '12', '2024-05-20 11:04:27'),
