(322, 'Guerra Pablo', '57449157', '2018-12-11', '2644748693', '<p>Edad: 5 a&ntilde;os<br>Sexo: masculino<br>Colegio: Del padro. Jardin de 5&nbsp;<br>Convive: Ambos padres y abuela materna.<br><br></p>\r\n<p>Motivo de consulta:&nbsp;</p>\r\n<p>Manifiesta muchos berrinches a partir del NO.<br>Tiene un apego muy dependiente para con sus papas, ya que no le gusta jugar solo y no come tampoco a menos que le den la comida en la boca. No se relaciona con los demas compa&ntilde;eritos, le cuesta sociabilizar.&nbsp;</p>\r\n<p>Antecedentes medicos:<br>Sufrio quemaduras de 3er grado en la espalda con aceite caliente por un accidente domestico ocacionando trastorno por estres postraumatico, reviviendo constantemente la situacion y no queriendose quedar solo.</p>', '12', '2024-08-09 12:39:07'),
