(325, 'Recabarren Carolina', '38764377', '1994-08-16', '2646305681', '<p>Edad: 28 a&ntilde;os<br>Genero: femenino<br>Estado Civil: Casada<br>Convive: Esposo y 2 hijos<br>Ocupacion: Policia<br>Jerarquia: Agente<br>Lugar de trabajo: Subcomisaria Sta. Lucia Este. Donde cumple la funcion de <strong>escribiente.</strong></p>\r\n<p><strong>Motivo de consulta:</strong></p>\r\n<p><strong>Cominzo de terapia: Agosto de 2024</strong></p>\r\n<p>Derivacion de sanidad para realizar tratamiento psicologico por 90 dias debido a que a la misma le urtaron el arma de la vivienda de su familia de origen, donde la guardaba cuando salia de casa.&nbsp;<br>Por lo cual se sugiere hacer tratamiento para constatar que la misma se encuentre ubicada en tiempo y espacio y apta psicologicamente&nbsp;para portar la misma teniendo en cuenta que a su ves a los dias vivencio una situacion traumatizante, donde a partir de la terapia constatar que no hayan hoy en dia secuelas que impidan el adecuado desarrollo de la profesion.&nbsp;</p>', '12', '2024-08-13 15:18:53'),
