(399, 'Juan Fernandez ', '31199332', '1984-09-22', '2644564570', '<p>Edad: 40 a&ntilde;os<br>Jerarquia: Oficial Principal. Ejerce hace 15 a&ntilde;os en la policia, en el mes de noviembre cumple 16 a&ntilde;os de servicio.<br>Trabaja: Relaciones Policiales donde cumple varias funciones.</p>\r\n<p>Motivo de consulta:</p>\r\n<p>Adquirir herramientas para afrontar situaciones familiares como tambien poder encontrar nuevamente la motivacion en el trabajo donde se siente abrumado.&nbsp;</p>', '12', '2024-10-08 16:33:05'),
(400, 'Valentina Yornet', '54930474', '2024-10-09', '2645457386', '<p>Edad: 9 a&ntilde;os<br>Escuela: Sta teresita. Asiste turno tarde.<br>Actividades que realiza: Patinaje artistico.<br>Domicilio: B&ordm; Conjunto 10. Villa krause.&nbsp;</p>\r\n<p>Motivo de consulta:&nbsp;</p>\r\n<p>Presenta comportamientos rebeldes, actitud negativista ante algunas situaciones y puesta de limites.&nbsp;</p>\r\n<p>Los papas han podido observar que le cuesta poner en palabras lo que le le sucede y lo que le angustia realmente.</p>\r\n<p>Objetivo de la terapia:&nbsp;<br>Brindar herramientas para que pueda aprender a registrar sus emociones y gestionarlas como tambien trabajar sobre su atoestima y autoconocepto.&nbsp;</p>', '12', '2024-10-09 13:42:19'),
(401, 'Neira Braian', '39955101', '1997-02-07', '2646117778', '<p>Edad: 28 a&ntilde;os<br>Estado civil: Casado<br>Convive: Esposa e hija<br>Domicilio: B&ordm; Formosa. Albardon<br>Ocupacion: Policia, hace 4 a&ntilde;os.&nbsp;<br>Jerarquia: Agente<br>Lugar de trabajo: Trabaja en la subcomisaria ansilta de Rawson.&nbsp;</p>\r\n<p>Motivo de consulta:</p>\r\n<p>Derivado por sanidad a traves de que el jefe de donde se encontraba trabajando realizo un informe de suspension por realizar comentarios no apropiados dentro del ambito laboral.&nbsp;</p>\r\n<p>Se le solicitan 4 meses de atencion psicologica, realizar un neurocognitivo y realizar interconuslta con el area de neurologia.&nbsp;</p>\r\n<p>Comienza terapia en octubre del 2024</p>\r\n<p>el Primer encuentro llega tarde a su sesion por haberse quedado dormido siendo que se le habia dado turno con bastante anticipacion, a su 4ta sesion ya no llega ni avisa porque no habria asistido.&nbsp;</p>\r\n<p>Al paciente a fines de febrero se le realiza el informe final de haber conlcuido con los 4 meses de terapia solicitada por sanidad, donde desde la misma es rebotado ya que consideraron que deberia continuar con terapia, a lo cual el paciente solicita un turno nuevamente y se le da para los primeros dias de marzo no asistiendo luego al turno. El mismo recien se reporta a la semana para avisar que por un inconveniente no habria podido asistir, se le da nuevamente un turno el 21 de marzo (viernes) 09hs donde el mismo nuevamente no asiste al turno y recien se reporta con el psicologo el dia jueves 10 de abril, casi un mes luego del turno, por lo cual habiendo pasado tiempo se habria dado lugar a otros afiliados que se encontrarian a la espera de un turno teniendo en cuenta la falta de compromiso del paciente.&nbsp;</p>', '12', '2024-10-09 15:40:30'),
(402, 'Rojas Antonia', '25462408', '1978-04-26', '2644189309', '<p>Edad: 46 a&ntilde;os<br>Estado Civil: Casada<br>Convive: Esposo e hijos<br>Ocupacion: Ama de casa.<br>En ocaciones ha realizado trabajos domesticos o cuidado de chicos.</p>\r\n<p>Motivo de consulta:&nbsp;</p>\r\n<p>Comenzo terapia psicologica en mayo de 2023 hasta diciembre del siguiente a&ntilde;o con el objetivo de trabajar en terapia su temperamento, aprender a autorregularse y regular sus emociones como tambien a sobrellevar y entenderse mejor con sus hijos y pareja.</p>\r\n<p>Retoma terapia psicologica en octubre del 2024 siendo que el menor de sus hijos es diagnosticado con diabetes y posible celiaquia y esos resultados le angustiaron bastante y busca en terapia poder aprender a sobrellevar esa angustia.&nbsp;</p>', '12', '2024-10-09 16:20:18'),
(403, 'Aballay Edgar', '35850623', '1991-05-10', '2645429901', '<p>Edad: 33 a&ntilde;os<br>Estado civil: Casado<br>Convive con esposa e hijos<br>Domicilio: Calle Rodriguez 41 (o). Chimbas<br>Jerarquia: Cabo<br>Trabaja hace 11 a&ntilde;os en la policia.<br>En la actualidad trabaja en el comando radiolectrico (o)</p>\r\n<p>Motivo de consulta:</p>\r\n<p>Derivacion desde sanidad por presentar sobrepeso.&nbsp;</p>', '12', '2024-10-10 15:52:39'),
