(407, 'Ontiveros Julieta', '38809751', '1995-11-03', '2645327970', '<p>Edad: 28 a&ntilde;os<br>Convive: Esposo e hija.<br>Estado Civil: Casada<br>Estudia: Prof. De Tecnolog&iacute;a.<br>Domicilio: Rodriguez 505. Vive en departamento. Localidad: Chimbas<br><br>Motivo de Consulta:</p>\r\n<p>Trabajar ansiedad, estres que esta padeciendo en este ultimo tiempo a raiz de varias situaciones que se han ido presentando en su vida.&nbsp;</p>', '12', '2024-10-16 14:12:23'),
(408, 'Teresita Narvaez', '42990363', '2000-08-14', '2645604440', '<p>Edad: 24 a&ntilde;os<br>Sexo: Femenino<br>Convive: Padre y hermanos<br>Domicilio: B&ordm; upc. Pocito<br>Estado civil: Soltera<br>Estudia: Ingenieria agronoma</p>\r\n<p>Motivo de consulta:</p>\r\n<p>Conflictos en la convivencia con su familiar de origen con la cual convive, a su ves presenta estancamiento en la facultad donde no puede avanzar hace a&ntilde;os.&nbsp;</p>', '12', '2024-10-17 14:33:16'),
(409, 'Miranda Claudia', '18207629', '1967-03-01', '2644176845', '<p>Diagn&oacute;stico m&eacute;dico: Lumbalgia</p>\r\n<p>Observaciones: Paciente femenina que comienza las sesiones en el dia de la fecha 21/10/24</p>\r\n<p>Cantidad de sesiones 10</p>\r\n<p>ALTA KIN&Eacute;SICA</p>', '9', '2024-10-21 14:01:43'),
(410, 'Idalgo Alfredo', '21489952', '1970-04-18', '2643205643', '<p>Diagn&oacute;stico m&eacute;dico: Tendinosis&nbsp;</p>\r\n<p>Cantidad de sesiones: 10</p>\r\n<p>Observaciones Paciente que comienza en el d&iacute;a de la fecha 22/10/24</p>\r\n<p>ALTA KIN&Eacute;SICA: DADO DE ALTA 8/11/24</p>', '9', '2024-10-22 15:07:32'),
(411, 'Paez Federico', '35857746', '1992-10-10', '2645661597', '<p>Edad: 33 a&ntilde;os<br>Sexo: Masculino<br>Profesion Policia<br>Jerarquia: Cabo</p>\r\n<p>Motivo de consulta:</p>\r\n<p>Se presenta por servicios sociales a fin de solicitar un turno de manera personal debido a que el mismo habria sido derivado de sanidad a principios del del mes de septiembre donde en ese momento se le da un turno en la fecha del 20/09/2024 lo cual al llegar el dia el mismo no se hace presente por la division no asistiendo al turno como tampoco dando aviso de que no asistir&iacute;a y de que no podria comenzar con terapia.&nbsp;</p>\r\n<p>El 29 de octubre del presente a&ntilde;o se presenta nuevamente habiendo pasado mas de un mes diciendo que se le diera nuevamente un turno porque el 14/11/2024 tiene turno con sanidad y deb&iacute;a presentar certificado de que esta siendo atendiendo, cuando el mismo habria sido derivado desde agosto.&nbsp;</p>\r\n<p>Se le indica que al no dar aviso de nada se otorgaron nuevos turnos y que en el momento no tendria lugar hasta que se liberara algun turno. Por lo cual menciona que se le habria roto el celular y no tenia como avisar pero se le indica que llamando a servicios sociales podia sacar el numero de la Lic. como hizo en un primer momento para solicitar el turno o acercarse nuevamente por la division sin haber pasado tanto tiempo ya que, tambien expreso que le habia coincidido el turno con un curso. De esta manera se percibe en un primer instante el compromiso para con la terapia y la manera desafiante de manejar la situacion considerando que el manejaria las cosas a su manera.&nbsp;</p>', '12', '2024-10-29 13:02:18'),
(412, 'Alvares Ariel', '22658628', '0072-03-31', '2644674470', '<p>Diagn&oacute;stico m&eacute;dico: tendinitis pectoral mayor superior</p>\r\n<p>observaciones: Paciente que comienza en el d&iacute;a de la fecha 29/10/24</p>\r\n<p>Cantidad de sesiones: 10</p>\r\n<p>ALTA KIN&Eacute;SICA: DADO DE ALTA EN EL DIA 8/11/24</p>', '9', '2024-10-30 14:54:58'),
(413, 'Olivarez Belen', '33966764', '1989-03-04', '2645713598', '<p>Edad: 35 a&ntilde;os<br>LIc. En Adm de Empresas<br>Estado CIvil: Soltera<br>Convive: Pareja e hija</p>\r\n<p>Motivo de consulta:&nbsp;</p>\r\n<p>Presenta desde hace un mes crisis de ansiedad y angustia recurrente, siendo el desencadenante de los sintomas el fallecimiento repentino de su figura paterna.&nbsp;</p>\r\n<p>Comienza tratamiento psicologico el 30/10/2024&nbsp;</p>', '12', '2024-10-30 15:11:42'),
(414, 'Arias Micaela', '40469427', '1997-08-28', '2644450180', '<p>Diagn&oacute;stico m&eacute;dico: Fractura de&nbsp;colles</p>\r\n<p>Observaciones: Paciente que comienza en el d&iacute;a de la fecha 30/10/24</p>\r\n<p>Cantidad de sesiones: 10</p>\r\n<p>ALTA KIN&Eacute;SICA:</p>', '9', '2024-10-30 15:44:47'),
(415, 'Vasquez Andres Alfredo', '25167004', '1976-01-29', '2645676509', '<p>Edad: 47 a&ntilde;os<br>Sexo: masculino<br>Casado<br>Convive con su se&ntilde;ora y 2 hijos.<br>Jerarquia: Sargento<br>Trabaja en el D8, donde tenia la funcion de encargado de monitoreo, en la actualidad realiza monitoreo.&nbsp;<br>Realizo el curso de policia que duraba 8 meses ingresando a las fuerzas armadas con 19 a&ntilde;os. Es decir 23 a&ntilde;os lleva cumpliendo el ejercicio de la profesion.&nbsp;</p>\r\n<p>Ha trabajado en:&nbsp;</p>\r\n<ul>\r\n<li>Cuerpo de vigilancia en la peatonal durante 6 a&ntilde;os.&nbsp;</li>\r\n<li>Comisaria 23</li>\r\n<li>Comisaria Chacrita</li>\r\n<li>Comisaria 31</li>\r\n<li>COmisaria 28 (6 a&ntilde;os)</li>\r\n<li>Unidad Operativa (o)</li>\r\n<li>Unidad operativa (e)</li>\r\n<li>D8. donde se encuentra actualmente 2024</li>\r\n</ul>\r\n<p><strong>Motivo de consulta:</strong></p>\r\n<p>Derivacion desde sanidad donde en octubre 5/10 le retienen el arma debido a llegar alcolizado a su casa y comenzar a los gritos y discutir con su esposa, lo cual lleva a que su hija mayor llame al 911 y por ende sus superiores debido al siguiente acontecimiento le retienen el arma y le indican un minimo de 12 sesiones.&nbsp;</p>\r\n<p>Hace 3 a&ntilde;os le retubieron el arma por haberla dejado en casa, donde ingresan ladrones a robar y se la llevan.&nbsp;</p>\r\n<p>Comienza terapia el 1/11/2024</p>\r\n<p><strong>Observaciones:&nbsp;</strong></p>\r\n<p>Bebe en ocaciones segun el, sobre todo los fines de semana, fuma tambien cigarrillo de nicotina.&nbsp;<br>Durante el primer encuentro se observo que miraba el lugar, estaba relajado como si hablara con un amigo pero a la vez presentaba inquietud fisica donde se movia constantemente, tocaba el escritorio, el mueble, por ahi le hacia preguntas personales a la terapeuta.<br>Se describio como loco, porque le gusta hacer chistes, pegar gritos.</p>\r\n<p>Tambien se observa una confusion temporo-espacial. Ya que, menciono en un comienzo que debido a que hace 3 a&ntilde;os le robaron el arma tubo que vender su camioneta por deudas, y por eso no puedo hacer limpieza de3 piletas como hacia, pero luego dijo: \" No me alcanza porque el otro dia tuve que vender la camioneta siendo que anteriormente habria mencionado que habia ocurrido hace 3 a&ntilde;os el acontecimiento. Como tambien que iba a hacer servicios de limpieza en la tarde, siendo que anteriormente tambien habria dicho que no podia hacerlos ya desde hace un tiempo porque no tenia su rodado.&nbsp;</p>\r\n<p>2da sesion informa que su se&ntilde;ora no quiere volver definitivamente con el debido en que cuando ocurrio el acontecimiento donde cayo alcolizado a casa le metio una pi&ntilde;a en la cara pero el mismo no se acuerda del hecho por estar bajo grandes efectos del alcohol, aunque menciona que quizas le ingresaron alguna sistancia en su bebida ya que no comprende como puede haberse puesto en tal estado.&nbsp;</p>\r\n<p>Tambien expreso que necesita adelantar las sesiones porque en enero tiene que llevar el registro de los 3 meses de sesion donde expreso que el hacia 3 meses venia llamando, y se le recordo que el acontecimiento habria ocurrido el 5 de octubre donde le retienen el arma, por lo cual no seria posible que el estubiese intentando llamar desde agosto, y ahi dijo bueno seprimbre y se le recordo nuevamente que el acontecimiento sucedio en octubre y que estamos en noviembre, donde ahi manifesto bueno me confundo. Es decir que hay una notable confusion por momentos del espacio-tiempo.&nbsp;</p>\r\n<p>El Paciente en Enero del 2025 deja de asistir por no abonar el costo del coseguro por lo cual se lo suspendio y dejo de asistir a terapia, buscando retomar a fines de marzo habiendo podido ponerse al dia con la \"cuota de la obra social\" dandole turno para el 7 de abril que es cuando habia disponibilidad por parte del terapeuta.&nbsp;</p>', '12', '2024-11-01 13:30:47'),
(416, 'Guajardo Maria', '12843526', '1958-02-09', '2645256024', '<p>Diagn&oacute;stico M&eacute;dico: tendinopatia de tobillo&nbsp;</p>\r\n<p>Observaciones: paciente que comienza en el d&iacute;a de la fecha 28/10/2024</p>\r\n<p>Cantidad de sesiones 10</p>\r\n<p>ALTA KINESICA: DADA DE ALTA EN EL D&Iacute;A DE LA FECHA 12/11/24</p>', '9', '2024-11-07 12:17:09'),
