(420, 'Coria Gladys', '13487588', '1959-09-14', '2646606734', '<p>Edad: 65&nbsp;<br>Sexo: Femenino<br>Estado Civil: Casada<br>Convive: Esposo e hijo<br>Ocupacion: Maestra jardinera juvilada.<br>Direccion: Santiago del Estero 480(s)</p>\r\n<p>Motivo de consulta:</p>\r\n<p>Presenta ansiedad constante, y el ultimo tiempo se le han presentado pensamientos recurrentes a cerca de su estado psiquico ya que, su mam&aacute; padec&iacute;a alzheimer y tiene predisposicion genetica. A partir del fallecimiento de su madre se distancio de 6 hermanos generando angustia constante.&nbsp;</p>\r\n<p>La paciente tendria turno el 4 de abril al cual no se presenta al turno y recien el dia 11 de abril informa que no habia podido asisitr.&nbsp;<br>La paciente anteriormente ya le habria ocurrido de \"olvidarse\" o que a ultimo momento le surja un inconveniente y no poder avisar de no llegar al turno.&nbsp;</p>', '12', '2024-11-08 11:21:16'),
