(428, 'Pellicer Mathias', '35852178', '1991-12-31', '2645119655', '<p>Edad: 33 a&ntilde;os<br>Sexo: Masculino<br>Convive: Pareja e hija<br>Jerarquia: Agente<br>Trabajo actual: Bomberos, comando sur. Actualmente se encuentra cumpliendo la funcion de escribiente.<br>Domicilio: Calle 7, Calle Mendoza.&nbsp;</p>\r\n<p>Motivo de Consulta:</p>\r\n<p>Retomar terapia psicologica ya que tubo un inconveniente en el trabajo hace un a&ntilde;o y medio y luego dejo terapi y siendo noviembre del 2024 decide que es importante retomar porque ademas le gustaria volver a reincorporarse bien en su trabajo y poder desempe&ntilde;ar tareas y actividades que antes realizaba.&nbsp;</p>', '12', '2024-11-15 16:09:43'),
