(436, 'LLanos Salsavilla Tiziano', '53107292', '2013-04-15', '24658602', '<p>Edad: 11 a&ntilde;os<br>Sexo: Masculino<br>COnvive: Con el padre unos dias y otros con abuelos maternos.<br>Colegio: San Bicente. Turno Tarde<br>Domicilio: Lemos y 11 de septiembre. Rawson.</p>\r\n<p>Motivo de consulta:</p>\r\n<p>Fallecimiento de la madre debido a un accidente de transito. Necesita realziar terapia para atravesar el duelo por la perdida.&nbsp;</p>', '12', '2024-12-11 13:22:54'),
