(438, 'Molina Mirian ', '17046066', '1964-01-01', '2646705274', '<p class=\"MsoNormal\" style=\"line-height: 150%;\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-family: \'Calibri Light\',sans-serif; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin;\">NFORME PSICOL&Oacute;GICO</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 150%;\"><span style=\"font-family: \'Calibri Light\',sans-serif; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin;\">Fecha: 17/12/2024</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 150%;\"><span style=\"font-family: \'Calibri Light\',sans-serif; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin;\">Nombre del paciente: Miriam Molina</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 150%;\"><span style=\"font-family: \'Calibri Light\',sans-serif; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin;\">Edad: 60 a&ntilde;os</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 150%;\"><span style=\"font-family: \'Calibri Light\',sans-serif; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin;\">Ocupaci&oacute;n: Pensionada</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 150%;\"><span style=\"font-family: \'Calibri Light\',sans-serif; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin;\">Diagn&oacute;sticos m&eacute;dicos previos: Diabetes y celiaqu&iacute;a</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 150%;\"><span style=\"font-family: \'Calibri Light\',sans-serif; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin;\">Medicaci&oacute;n actual: Levotiroxina y Alpax (1 comprimido por la noche, para inducir el sue&ntilde;o)</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 150%;\"><span style=\"font-family: \'Calibri Light\',sans-serif; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin;\">Motivo de consulta: Solicitud de orientaci&oacute;n psicol&oacute;gica y emocional</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 150%;\"><span style=\"font-family: \'Calibri Light\',sans-serif; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 150%;\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-family: \'Calibri Light\',sans-serif; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin;\">DESCRIPCI&Oacute;N DE LA SITUACI&Oacute;N</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 150%;\"><span style=\"font-family: \'Calibri Light\',sans-serif; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin;\">La paciente se presenta en la fecha mencionada solicitando orientaci&oacute;n y gu&iacute;a frente a su historia de vida. Durante la entrevista, manifiesta sentimientos persistentes de desesperanza, verbalizando ideas recurrentes de suicidio, describiendo su existencia como &ldquo;una basura&rdquo; y afirmando que &ldquo;no vale la pena vivir&rdquo;. Asimismo, hace referencia a intentos previos de quitarse la vida.</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 150%;\"><span style=\"font-family: \'Calibri Light\',sans-serif; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin;\">La paciente menciona ser divorciada, con una hija de 30 a&ntilde;os que estudia abogac&iacute;a y est&aacute; pr&oacute;xima a recibirse. Expone, adem&aacute;s, su situaci&oacute;n econ&oacute;mica inestable, ya que complementa su pensi&oacute;n con trabajos espor&aacute;dicos relacionados con inyectables, curaci&oacute;n de heridas y cuidado de enfermos, los cuales no le resultan rentables.</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 150%;\"><span style=\"font-family: \'Calibri Light\',sans-serif; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 150%;\"><span style=\"font-family: \'Calibri Light\',sans-serif; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 150%;\"><span style=\"font-family: \'Calibri Light\',sans-serif; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 150%;\"><span style=\"font-family: \'Calibri Light\',sans-serif; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin;\">Durante la sesi&oacute;n, se observa:</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 150%;\"><span style=\"font-family: \'Calibri Light\',sans-serif; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin;\"><span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>&bull;<span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>Desregulaci&oacute;n emocional severa: Llanto constante e incontenible.</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 150%;\"><span style=\"font-family: \'Calibri Light\',sans-serif; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin;\"><span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>&bull;<span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>Sintomatolog&iacute;a cognitiva y desorientaci&oacute;n: Expresa &ldquo;perderse en la calle&rdquo;.</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 150%;\"><span style=\"font-family: \'Calibri Light\',sans-serif; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin;\"><span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>&bull;<span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>Expectativas irreales respecto al tratamiento: Solicita soluciones inmediatas a su malestar y no comprende el proceso gradual de la terapia.</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 150%;\"><span style=\"font-family: \'Calibri Light\',sans-serif; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 150%;\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-family: \'Calibri Light\',sans-serif; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin;\">INTERVENCI&Oacute;N Y RECOMENDACIONES</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 150%;\"><span style=\"font-family: \'Calibri Light\',sans-serif; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin;\">Ante la gravedad del cuadro presentado, se le ofreci&oacute; contenci&oacute;n emocional durante la sesi&oacute;n y se indic&oacute; de manera urgente la necesidad de atenci&oacute;n psiqui&aacute;trica interdisciplinaria para evaluaci&oacute;n y eventual estabilizaci&oacute;n farmacol&oacute;gica, debido a la notable desregulaci&oacute;n emocional y el riesgo potencial de autolesiones o suicidio. Tambi&eacute;n se sugiri&oacute; un seguimiento cl&iacute;nico general, dado su historial m&eacute;dico.</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 150%;\"><span style=\"font-family: \'Calibri Light\',sans-serif; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin;\">Sin embargo, la paciente se neg&oacute; a aceptar la derivaci&oacute;n propuesta, manifestando resistencia al tratamiento psiqui&aacute;trico y a intervenciones m&eacute;dicas adicionales.</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 150%;\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-family: \'Calibri Light\',sans-serif; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin;\">CONCLUSI&Oacute;N</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 150%;\"><span style=\"font-family: \'Calibri Light\',sans-serif; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin;\">Dada la gravedad de los dichos e indicadores mencionados durante la sesi&oacute;n, y con el fin de resguardar mi responsabilidad como profesional de la salud mental, informo la presente situaci&oacute;n al superior correspondiente, solicitando que se intervenga en el &aacute;mbito que se considere adecuado para garantizar la integridad f&iacute;sica y emocional de la paciente.</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 150%;\"><span style=\"font-family: \'Calibri Light\',sans-serif; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin;\">&nbsp;</span></p>', '17', '2024-12-17 14:07:20'),
(439, 'Betiana Cornejo', '32689244', '1986-12-10', '2644136683', '<p>Edad: 38 a&ntilde;os<br>Sexo: Femenino<br>Ocupacion: Docente</p>\r\n<p>Motivo de consulta:&nbsp;</p>\r\n<p>Reciente perdida de embarazo. Abordar el duelo por la perdida reciente.</p>', '12', '2024-12-20 15:52:03'),
(440, 'Andrea Rosalez', '36253688', '1993-05-14', '2644040141', '<p>Edad: 31 a&ntilde;os<br>Sexo: Femenino<br>Domicilio: Villa Nerja. Paula Albarracin&nbsp;<br>Convive: Pareja e hijo de su pareja<br>jerarquia: Agente<br>Trabajo actual: Comando (o)</p>\r\n<p>Motivo de consulta:</p>\r\n<p>Realizar terapia psicologica para acompa&ntilde;ar a la paciente por la perdida de tenencia del hijo debido a una denuncia falsa realizada por su ex pareja.&nbsp;</p>', '12', '2024-12-26 15:47:16'),
(441, 'Contreras Rosana', '22084266', '1971-03-22', '2645838863', '<p>Edad: 53 a&ntilde;os<br>Sexo: Femenino<br>Domicilio: B&ordm; Cesap Mza 6. Rivadavia.<br>Convive: Esposo y 3 hijos<br>Ama de casa<br><br>Motivo de Consulta: Padece principios de depresion y ataques de panico.&nbsp;</p>', '12', '2025-01-02 15:14:33'),
