(448, 'GALLARDO ELIZABETH ', '35850836', '0000-00-00', '2644448906', '<p>&nbsp; &nbsp;HISTORIA CLINICA :</p>\r\n<p>N Y A: GALLARDO ELIZABETH</p>\r\n<p>DNI:35850836</p>\r\n<p>DIAGNOSTICO : FRACTURA DE TOBILLO CON PLACA Y TORNILLOS.</p>\r\n<p>INICIO :02/12/24</p>\r\n<p>ALTA: 02/03/25</p>', '13', '2025-01-09 16:10:27'),
(449, 'CHAVES CARLOS ', '21361957', '1111-11-11', '2644511952', '<p>&nbsp; &nbsp; &nbsp; HISTORIA CLINICA&nbsp;</p>\r\n<p>PACIENTE: CHAVES CARLOS&nbsp;</p>\r\n<p>DIAGNOSTICO: CIRUGIA DE MENISCOS</p>\r\n<p>ANTECEDENTES: PACIENTE CON ARTROSIS DE CADERA IZQUIERDA , RODILLA IZQ. COLUMNA LUMBAR CON ARTROSIS, HERNIAS DISCALES CON COMPROMISO DEL NERVIO CIATICO DEL LADO IZQUIERDO.</p>\r\n<p>INSULINO RESISTENTE, OBESIDAD CENTRAL.</p>\r\n<p>INICIO: 04/04/2024</p>\r\n<p>ALTA : 10/01/2025</p>', '13', '2025-01-10 15:10:49'),
(450, 'LOPEZ ALEJANDRO ', '28538742', '0000-00-00', '2645146316', '<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;HISTORIA CLINICA&nbsp;</p>\r\n<p>PACIENTE: ALEJANDRO LOPEZ&nbsp;</p>\r\n<p>DIAGNOSTICO: DISTENSION DE ARTICULACION ACROMIO CLAVICULAR</p>\r\n<p>INICIO: 02/12/24</p>\r\n<p>ALTA: 03/01/25</p>', '13', '2025-01-10 15:33:01'),
(451, 'Pizarro abril', '49562526', '2009-04-23', '2646281668', '<p>Edad: 15 a&ntilde;os<br>Genero: Femenino<br>Escuela: Secundaria carlos Pellegrini<br>Convive: Padres y hermanos<br><br>Motivo de consulta:&nbsp;</p>\r\n<p>Conflictos familiares, sobre todo con figuras paternas, comportamientos y actitudes desafiantes como negativistas.&nbsp;<br>Pensamientos autolesivos y negativos contra su persona.&nbsp;</p>', '12', '2025-01-13 13:59:18'),
(452, 'Diego Dominguez', '28967530', '1981-08-14', '2645469455', '<p>Dominguez Diego</p>\r\n<p>Genero: Masculino<br>Domicilio: Santa maria de iri 133(s) Sta Lucia.<br>Convive: Solo<br>Estado Civil: Separado<br>Jerarquia: Cabo 1ro&nbsp;<br>Tiene una hija de 16 a&ntilde;os.<br>Trabajo: D8 en comunicaciones.&nbsp;<br><br>Motivo de Consulta:&nbsp;</p>\r\n<p>ACV en diciembre del 2024 y lo cual en la actualidad le genera fobia y panico atravesar por una resonancia magnetica por el encierro.<br>Trabajar ansiedad y estres.&nbsp;</p>', '12', '2025-01-13 15:21:29'),
(453, 'Morales Josue', '35510884', '1990-11-01', '2645266447', '<p>Edad: 34 a&ntilde;os<br>Genero: Masculino<br>Domicilio: Rawson<br>Jerarquia: Cabo<br>Trabaja actualmente: Geras desde hace 9 a&ntilde;os.&nbsp;<br>Convive: Esposa e hijos<br>Estado civil: Casado</p>\r\n<p>Motivo de consulta:&nbsp;</p>\r\n<p>trabajar relacion de pareja, inseguridades y emociones.</p>', '12', '2025-01-13 15:26:56'),
(454, 'Riveros Camila', '43488918', '2001-06-19', '2646294848', '<p>Edad: 23 a&ntilde;os<br>Estudiante de psicologia<br>Convive con la madre<br><br></p>\r\n<p>Motivo de consulta:&nbsp;</p>\r\n<p>Comienza terapia psicologica en abril del 2023 a raiz del fallecimiento de su padre y poder trabajar la relacion aspera que sostiene con su mama como la presencia de sintomas de angustia y ansiedad permanente. En enero del 2024 se finaliza la terapia con Camila. En enero del 2025 busca retomar terapia para trabajar nuevamente sentimientos encontrados que se encuentra atravesando como determinadas situaciones que la abruman y no sabe coo resolverlas.&nbsp;</p>', '12', '2025-01-14 13:34:15'),
(455, 'Matias Liyo', '49101006', '2009-11-06', '2645434210', '<p>Edad: 16 a&ntilde;os<br>Convive: Padres y hnos<br>Escuela: Juan 23.<br>4to a&ntilde;o de la secundaria<br><br>Motivo de consulta:</p>\r\n<p>Ataques de panico y de ansiedad.&nbsp;</p>', '12', '2025-01-15 16:09:25'),
(456, 'Morales Tatiana', '50808862', '2025-01-16', '2644649585', '<p>Edad: 13 a&ntilde;os<br>Convive: padres y hermanos<br>Madre: Policia y padre trabaja en medio ambiente<br>Domicilio: Valle Fertil<br><br>Motivo de consulta:&nbsp;</p>\r\n<p>Actualmente se encuentra teniendo conductas desafiantes y negativistas para con los padres, como tambien comenzando un noviazgo con un chico 6 a&ntilde;os mayot que ella siendo preocupante para la familia y generando en ella comportamientos no apropiados o esperados.&nbsp;</p>', '12', '2025-01-16 14:58:18'),
(457, 'Escarion Susana', '6039941', '1949-03-08', '2645986804', '<p>Diagn&oacute;stico m&eacute;dico: Tendinitis</p>\r\n<p>Observaciones: COMIENZA EN EL D&Iacute;A DE LA FECHA 13/01/2025</p>\r\n<p>Cantidad de sesiones: 10</p>\r\n<p>ALTA KIN&Eacute;SICA: Dada de alta 03/02/2025</p>', '9', '2025-01-20 15:41:01'),
