(459, 'Moreira Luana', '50735401', '2010-11-12', '2645193366', '<p>Edad: 14 a&ntilde;os<br>COnvive: Padres y hermana<br>Escuela: Nacional de Rawson. Asiste turno ma&ntilde;ana y va a 3ro de la secundaria.<br>En la actualidad no realiza ningun deporte.<br>Anteriormente realizaba hockey sobre cesped.</p>\r\n<p>Antecedentes:&nbsp;</p>\r\n<p>Celiaca<br>Presenta resistencia a la insulina.</p>\r\n<p>Motivo de consulta:</p>\r\n<p>Asiste por presentar dificultades en el aprendizaje, donde es derivada por el area de psicopedagogia a psicologia para evaluar su estado animico y descartar que parte de la frustracion constante y problemas que presenta en la escuela tengan que ver con lo emocional.&nbsp;</p>\r\n<p>Comenzaria terapia en febrero del 2025</p>', '12', '2025-02-04 15:35:22'),
(460, ' BRITTIER, LEONELA', '34047637', '1987-12-25', '2646605443', '<p>10 SESIONES DE FISIOKINESIOTERAPIA INICIA EL DIA 03/02/25</p>\r\n<p>DIAGNOSTICO: SINDROME FEMORAL</p>', '16', '2025-02-06 22:30:12'),
(461, 'GORDILLO, MARCELO', '16332283', '1963-07-05', '2645750053', '<p>15 SESIONES DE FISIOKINESIOTERAPIA INICIO EL DIA: 03/02/25</p>\r\n<p>DIAGNOSTICO: PARKINSON??? SEGUN PEDIDO MEDICO</p>', '16', '2025-02-06 22:33:44'),
(462, 'PASTRAN, ELIANA', '33095413', '1987-11-29', '264 4809929', '<p>5 SESIONES DE FISIO KINESIOTERAPIA INICIO EL DIA 04/02/25</p>\r\n<p>DIAGNOSTICO: SINDROME DEL MANGUITO ROTADOR DERECHO</p>', '16', '2025-02-06 22:37:58'),
(463, 'Andrade Gonzalo', '42858186', '2000-08-04', '2645139960', '<p>Edad: 24 a&ntilde;os<br>Convive: Padres<br>Estudia: Lic. En Filosofia</p>\r\n<p>Motivo de consulta:</p>\r\n<p>Inseguridades respecto a la carrera, busca trabajar aspectos de su personladidad teniendo en cuenta que es bastante inhibido y le cuesta relacionarse con sus pares en especial con varones por lo cual acude a realizar terapia psicologica.</p>\r\n<p>Comienza terapia psicologica en febrero del 2025.</p>', '12', '2025-02-10 14:05:43'),
(464, 'CHAVES VALENTINO', '58159884', '2020-05-01', '156193180', '<p>El paciente Valentino Chavez, de 4 a&ntilde;os de edadfue derivado del gabinete escolar por el area exclusivamente de psicopedagogia y fonoaudiologia. Dificultades en la atencion y concentracion.</p>', '19', '2025-02-11 15:17:45'),
(465, 'Villafañe Austin', '56589349', '2017-10-25', '2645682764', '<p>Derivacion escolar, deambula en el aula, fugas del aula y problemas para ejecutar consignas. Lecto escritura no afianzada, realiza copiado, no lee con autonomia. Violencia domestica dejo de hablar el paciente por algunos meses en el a&ntilde;o 2021. Alteraciones en el neurodesarrollo.&nbsp;</p>\r\n<p>EN EL DIA DE LA FECHA 20 DE MAYO EL PACIENTE FALTO DEBIDO QUE EL PADRE NO LO TRAJO, LA MAMA SE COMUNICO AVISANDO QUE EL PADRE LO TIENE AL PACIENTE.&nbsp;</p>', '19', '2025-02-11 15:22:06'),
(466, 'Luana Delfina Moreira Ozan ', '50735401', '2010-11-12', '2645193366', '<p>Dificultad en realizar ejercicios matematicos debido a una perdida significativa en su infancia, se presume un diagnotico debido debido a sus emociones y a un duelo no resuelto llo que conlleva una carga afectiva hacia distintas ares escolares. Derivada del gabinete escolar.&nbsp;</p>\r\n<p>LA PACIENTE EL DIA JUEVES 15 DE MAYO TENIA TURNO Y NO ASISTIO. NO DIO AVISO DE SU INASISTENCIA&nbsp;</p>', '19', '2025-02-11 15:27:22'),
(467, 'Guzman Liam ', '56013938', '2017-03-03', '2646722803', '<p>Liam tiene 7 a&ntilde;os de edad, esta presuntamente diagnosticado con Dislexia. Acude a terapias fonoaudiologicas y psicopedagogicas. Informe del neurologo con sugerencia de Docente de Apoyo a la Inclusion para este nuevo ciclo lectivo 2025 en el area escolar.&nbsp;</p>', '19', '2025-02-11 15:30:57'),
(468, 'VIDABLE CARINA ', '22347016', '1111-11-11', '2646289024', '<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; HISTORIA CLINICA&nbsp;</p>\r\n<p>PACIENTE INGRESA EN EL MES DE FEBRERO CON LUMBALGIA .</p>\r\n<p>SIN ANTECEDENTES DE ENFERMEDADES (MENOPAUSIA PRECOZ)</p>\r\n<p>ALTA MEDICA : MARZO</p>', '13', '2025-02-12 12:24:54'),
