(471, 'PINTO ELIANA ', '33336337', '0000-00-00', '2645145624', '<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; HISTORIA CLINICA&nbsp;</p>\r\n<p>PACIENTE INGRESA A KINESIO CON FASCITIS PLANTAR EN EL MES DE ENERO.</p>\r\n<p>ANTECEDENTES: SOBREPESO, LESION DE RODILLAS Y ,AMBOS PIES.</p>\r\n<p>ALTA MEDICA: 15 FEBERO.</p>\r\n<p>&nbsp;</p>', '13', '2025-02-12 15:21:16'),
(472, 'CAMASTRI MELINA ', '22625323', '1111-11-11', '2645275546', '<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;HISTORIA CLINICA&nbsp;</p>\r\n<p>PACIENTE INGRESA 10 DE FEBRERO CON LUMBALGIA, HERNIA DISCAL Y SINDROME CIATICO. DOLOR AGUDO.</p>\r\n<p>ANTECEDENTES: EMBARAZOS, DOLORES LUMBARES.</p>\r\n<p>ALTA MEDICA: FINES DE FEBRERO.</p>', '13', '2025-02-13 12:43:26'),
