(474, 'Vila Abril', '44761138', '2003-04-22', '2644806787', '<p>Edad: 21 a&ntilde;os<br>Convive: Padres y hermanos<br>Estudiante de psicologia, se encuentra cursando el 4to a&ntilde;o de la carrera.&nbsp;<br>Domicilio: Rawson.&nbsp;</p>\r\n<p>Motivo de consulta:&nbsp;</p>\r\n<p>Busca tratar su baja autoestima, y la baja tolerancia a la frustracion. De chica ejercia autoleciones sobre su cuerpo y en la actualidad habria comenzado nuevamente a lastimarse debido a la falta de limites para con otras personas y el vinculo dificil que tiene con su madre.&nbsp;</p>\r\n<p>Comienza terapia en febrero del 2025&nbsp;</p>\r\n<p>Primeros dias de abril la paciente tendria turno, avisando sobre la hora que no podria asistir, lo cual se le da nuevamente para el dia miecoles 16 de abril en el turno de las 11:00hs no presentandose al encuentro nuevamente y sin avisar.&nbsp;</p>', '12', '2025-02-13 16:24:21'),
(475, 'Costa Florencia', '37646693', '1993-07-04', '2645886563', '<p>Edad: 31 a&ntilde;os<br>Trabaja: Area de provicion social.<br>Jerarquia: Agente<br>Convive: COn su pareja tambien policia de 41 a&ntilde;os.</p>\r\n<p>Motivo de constulta:&nbsp;</p>\r\n<p>Aprender a sobrellevar y afrontar Dificultades para tomar desiciones e inconvenientes con ella misma y con el lugar de trabajo. Aprender a organizarse.&nbsp;</p>', '12', '2025-02-13 16:26:59'),
(476, 'CASTRO NAHUEL ', '50005931', '2011-08-18', '00', '<p>Nahuel desde sus 3 a&ntilde;os no se comunicaba, empezo jardin de 4 a&ntilde;os y continuaba de la misma manera por lo tanto desde el jardin se solicito terapia fonoaudiologica, ya que tartamudeaba. En primer grado fue internado por una cirugia menor de una muela lo que llevo a que el paciente perdiera junio y julio de escolarizacion y regresara en agosto al finalizar el receso escolar. El informe de la Psicopedagoga informa de un presunto retraso madurativo leve. Estuvo con acompa&ntilde;amiento de docente de acompa&ntilde;amiento a la inclusion, desde 1 grado hasta 5 grado, sexto a&ntilde;o se sugirio por parte del gabinete escolar no ir con DAI.&nbsp;</p>', '19', '2025-02-17 13:23:58'),
