(479, 'Yamila Chavez', '37833142', '1993-09-28', '2645568724', '<p>Edad: 31 a&ntilde;os<br>Sexo: Femenino<br>Convive: Con su pareja actual aunque se encuentra aun casada con su pareja anterior, el cual es policia y no le da el divorcio.&nbsp;<br>Estudia: Maestra de nivel primario a partir del 2025<br><br></p>\r\n<p>Motivo de consulta:</p>\r\n<p>Perdida reciente de un bebe con su actual pareja y separacion con la misma por motivos de violencia verbal y demas situaciones que implican una mala convivencia y relacion.&nbsp;</p>', '12', '2025-02-17 13:47:53'),
