(497, 'Oliva Enzo ', '41053942', '1111-11-11', '2645883162', '<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Historia Clinica&nbsp;</p>\r\n<p>Paciente ingresa con diagnostico de cirugia de femur lado derecho por fractura expuesta, con clavo endomedular.</p>\r\n<p>Antecedentes: accidente en moto. golpes en el hombro izquierdo.</p>\r\n<p>Ingreso: Noviembre 2024-</p>\r\n<p>Alta: Abril&nbsp;</p>\r\n<p>&nbsp;</p>', '13', '2025-03-05 11:23:16'),
(498, 'VILA SELIN', '56830093', '2013-04-13', '2644559398', '<p>La familia de Selin solicita el tratamiento y sugerencia psicopedagogica para abordar dificultades de aprendizaje y conductual. Selin estuvo en terapia Psicopedagogica que asistio por un tiempo debido a problemas economicos no eran frecuentes. Se sugiere a la familia trabajar en el autoestima, realizar alguna actividad fisica y derivacion al neurologo infantil. El trabajo en la escuela debe ser atento y personalizado, sentarse adelante, cerca de los docentes con el proposito de controlar que realice actividades y no se distraiga.</p>', '19', '2025-03-05 11:24:31'),
(499, 'SANCHEZ TIFANY', '54930489', '2015-09-05', '2645631084', '<p>La paciente es diagnostica con TDA. Tifany no fue al jardin, realizo primer grado en andacollo a mitad de a&ntilde;o fue derivada a la psicopedagoga,&nbsp; en segundo grado cambia de escuela a la localidad de Albardon el cual fue un a&ntilde;o complejo a nivel academico. Por parte de docentes y cuerpo directivo se propuso que la paciente repitiera el a&ntilde;o cursado. La acompa&ntilde;a una dai desde que esta presente es notorio el cambio ya que aprendio a leer y a escribir.&nbsp;</p>\r\n<p>La paciente se caracteriza por ser timida, cerrada pero a su ves es educada.</p>\r\n<p>No tiene relacion con la figura paterna.</p>', '19', '2025-03-05 11:33:42'),
(500, 'Perez Maria', '5260387', '1946-07-31', '2645620013', '<p>Diagn&oacute;stico m&eacute;dico Artrosis</p>\r\n<p>Cantidad de sesiones 5</p>\r\n<p>OBSERVACIONES pACIENTE QUE COMIENZA EN EL D&Iacute;A DE LA FECHA</p>\r\n<p>ALTA KIN&Eacute;SICA</p>', '9', '2025-03-10 15:19:00'),
(501, 'Rivero Marcos', '48596701', '2008-01-24', '2644634129', '<p>Diagn&oacute;stico M&eacute;dico Lesion LCA</p>\r\n<p>Cantidad de sesiones 10</p>\r\n<p>Observaciones Paciente que comienza en el d&iacute;a de la fecha</p>\r\n<p>ALTA KIN&Eacute;SICA</p>', '9', '2025-03-10 15:27:04'),
(502, 'FLORES CUELLO MILO', '54930483', '2015-08-22', '2645848920', '<p>EL PACIENTE ES DIAGNOSTICADO CON TEL E HIPOACUSIA, ACUDE A LA ESCUELA NORMAL SARMIENTO. LAS EVALUACIONES SE ADECUAN, TIENE DAI DESDE QUE COMENZO LA ESCOLARIZACION. ACUDE A SESIONES DE FONOAUDIOLOGIA.&nbsp;</p>', '19', '2025-03-11 12:09:26'),
(503, 'Puga Alejo', '43612914', '2001-09-05', '2645613934', '<p>Edad: 23 A&ntilde;os<br>Domicilio: Rivadavia<br>Convive: Madre y un hermano<br>Estudia: Seguridad e HIgiene<br>Trabaja: Papeleria salomon y tienda de comidas.</p>\r\n<p>Motivo de consulta:</p>\r\n<p>Trabajar ansiedad, impulsividad como tambien aspectos de su persona, autoestima, emociones y relacion con su madre.&nbsp;</p>', '12', '2025-03-11 14:01:54'),
(504, 'LORENZO CANTO', '55826858', '2018-05-05', '2646738114', '<p class=\"MsoNormal\" style=\"line-height: 115%;\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 12.0pt; line-height: 115%;\">▶️<span style=\"text-decoration: underline;\"> DERIVACION TERAPIA COGNITIVO CONDUCTUAL</span></span></strong></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 115%;\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 12.0pt; line-height: 115%;\">INFORME PSICOL&Oacute;GICO</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 115%;\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 12.0pt; line-height: 115%;\">Nombre: Lorenzo Canto</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 115%;\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 12.0pt; line-height: 115%;\">Edad: 7 a&ntilde;os</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 115%;\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 12.0pt; line-height: 115%;\">Motivo de consulta: Derivaci&oacute;n del neur&oacute;logo sin diagn&oacute;stico aparente</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 115%;\"><strong style=\"mso-bidi-font-weight: normal;\"><u><span style=\"font-size: 12.0pt; line-height: 115%;\">Evaluaci&oacute;n y desarrollo del tratamiento</span></u></strong></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 115%;\"><span style=\"font-size: 12.0pt; line-height: 115%;\">Lorenzo se presenta como un ni&ntilde;o sociable, con buena adaptaci&oacute;n a las propuestas de juego y actividades did&aacute;cticas. Sin embargo, a lo largo de las sesiones, se ha evidenciado una marcada hiperactividad y una atenci&oacute;n dispersa. A pesar de ello, cuando se le presentan estructuras claras y un orden establecido, logra adaptarse de manera favorable.</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 115%;\"><span style=\"font-size: 12.0pt; line-height: 115%;\">Se han implementado t&eacute;cnicas de autoestima y autocontrol, observ&aacute;ndose progresos significativos en su regulaci&oacute;n emocional y conductual dentro del espacio terap&eacute;utico.</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 115%;\"><span style=\"font-size: 12.0pt; line-height: 115%;\">A nivel familiar, se han registrado episodios de angustia intensa y agresividad hacia su madre, acompa&ntilde;ados de dolores de cabeza fuertes. Ante estas situaciones, se aplicaron estrategias de regulaci&oacute;n emocional, detect&aacute;ndose una falta marcada de l&iacute;mites en el hogar. Se brind&oacute; orientaci&oacute;n y asesoramiento a la madre respecto a la importancia de establecer normas claras y consistentes para favorecer el desarrollo emocional y conductual de Lorenzo.</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 115%;\"><span style=\"font-size: 12.0pt; line-height: 115%;\">En el &aacute;mbito escolar, ha presentado ciertas conductas disruptivas, principalmente relacionadas con su dificultad para mantener la atenci&oacute;n y su nivel de hiperactividad. No obstante, mediante t&eacute;cnicas de autocontrol, se ha logrado mejorar su regulaci&oacute;n en determinados momentos.</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 115%;\"><span style=\"font-size: 12.0pt; line-height: 115%;\">Dado que la madre ha manifestado conflictos con el equipo educativo de la escuela actual y en funci&oacute;n de observar la adaptaci&oacute;n de Lorenzo en otro entorno escolar, se ha solicitado el cambio de instituci&oacute;n. Se considera relevante continuar con el seguimiento del ni&ntilde;o para evaluar su desempe&ntilde;o en el nuevo contexto educativo y ajustar las estrategias de intervenci&oacute;n seg&uacute;n sea necesario.</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 115%;\"><span style=\"font-size: 12.0pt; line-height: 115%;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 115%;\"><strong style=\"mso-bidi-font-weight: normal;\"><u><span style=\"font-size: 12.0pt; line-height: 115%;\">Conclusiones y recomendaciones</span></u></strong></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 115%;\"><span style=\"font-size: 12.0pt; line-height: 115%;\"><span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>&bull;<span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>Lorenzo presenta dificultades en la regulaci&oacute;n de su atenci&oacute;n y conducta, aunque muestra buena respuesta a las estrategias estructuradas y de autocontrol.</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 115%;\"><span style=\"font-size: 12.0pt; line-height: 115%;\"><span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>&bull;<span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>Se recomienda continuar con la terapia psicol&oacute;gica para reforzar las herramientas adquiridas y acompa&ntilde;ar el proceso de adaptaci&oacute;n escolar.</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 115%;\"><span style=\"font-size: 12.0pt; line-height: 115%;\"><span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>&bull;<span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>Es fundamental la implementaci&oacute;n de l&iacute;mites claros en el hogar para promover una estructura predecible que facilite su regulaci&oacute;n emocional y conductual.</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 115%;\"><span style=\"font-size: 12.0pt; line-height: 115%;\"><span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>&bull;<span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>Se sugiere el seguimiento por parte del equipo educativo de la nueva instituci&oacute;n para evaluar su adaptaci&oacute;n y desarrollo dentro del &aacute;mbito escolar.</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 115%;\"><span style=\"font-size: 12.0pt; line-height: 115%;\"><span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>&bull;<span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>Considerando las caracter&iacute;sticas observadas en el ni&ntilde;o, se recomienda la <strong style=\"mso-bidi-font-weight: normal;\">derivaci&oacute;n a un colega especializado en infancia, con orientaci&oacute;n en terapia cognitivo-conductual</strong>, con el objetivo de trabajar espec&iacute;ficamente en el desarrollo de habilidades de autorregulaci&oacute;n, manejo de la hiperactividad y estrategias para mejorar su capacidad atencional.</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 115%;\"><span style=\"font-size: 12.0pt; line-height: 115%;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: right; line-height: 115%;\" align=\"right\"><span style=\"font-size: 12.0pt; line-height: 115%;\">Sin m&aacute;s que informar, quedo a su disposici&oacute;n.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: right; line-height: 115%;\" align=\"right\"><span style=\"font-size: 12.0pt; line-height: 115%;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: right; line-height: 115%;\" align=\"right\"><span style=\"font-size: 12.0pt; line-height: 115%;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: right; line-height: 115%;\" align=\"right\"><span style=\"font-size: 12.0pt; line-height: 115%;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: right; line-height: 115%;\" align=\"right\"><span style=\"font-size: 12.0pt; line-height: 115%;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: right; line-height: 115%;\" align=\"right\"><span style=\"font-size: 12.0pt; line-height: 115%;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: right; line-height: 115%;\" align=\"right\"><span style=\"font-size: 12.0pt; line-height: 115%;\">Saluda atte. Licenciada Sabrina Olivieri</span></p>', '17', '2025-03-11 14:47:11'),
(505, 'NAHIARA CARRIZO', '55174137', '2016-01-18', '264623783', '<p>LA PACIENTE ES DERIVADA POR LA ESCUELA A LA QUE ASISTE ACTUALMNETE \"COLEGIO SAN BERNARDO\" TIENE 9 A&Ntilde;OS. PROVIENE DE UNA FAMILIA CONFLICTIVA EN DONDE HUBO VIOLENCIA DOMESTICA, LA MENOR TIENE UNA HERMANA Y LOS PADRES DIVORSIADOS AMBOS FUNCIONARIOS DE LA POLICIA. LA MAMA COMENTA QUE LE CUESTA LLEGAR A LOS CONTENIDOS BRINDADOS POR LA DOCENTE A CARGO, TRAJO UN INFORME EXTENDIDO POR ANTERIOR PSICOPEDAGOGA DEL A&Ntilde;O 2024 EN DONDE FUE EVALUADA CON UN WISC 5.</p>\r\n<p>&nbsp;</p>\r\n<p>EN EL DIA DE LA FECHA 21 DE MAYO LA PACIENTE NO ASISTIO DEBIDO A QUE LA MAM&Agrave; NO PUEDE TRAERLA POR UN RECARGO.</p>', '19', '2025-03-12 13:13:08'),
