(507, 'SARRUFF, JUAN IGNACIO', '46484355', '0001-01-01', '2644165323', '<p>DIAGNOSTICO MEDICO: FX DE 5TO METATARSIANO</p>\r\n<p>&nbsp;INICIA SESIONES EL DIA 12/03/25</p>\r\n<p>CANTIDAD DE SESIONES: 10 CON TRATAMIENTO FISIOKINESICO</p>', '16', '2025-03-12 14:32:03'),
(508, 'RODRIGUEZ, MAITENA', '41830815', '0001-01-01', '2645725353', '<p>DIAGNOSTICO MEDICO: CERVICALGIA Y LUMBALGIA (PACIENTE CON SINDROME DE MARFAN)</p>\r\n<p>CANTIDAD DE SESIONES:10 DE CADA UNA CON TERAPIA FISICA Y FISIOTERAPIA</p>', '16', '2025-03-12 14:43:17'),
(509, 'Garipe Victoria', '39956807', '1996-12-16', '2647433837', '<p>Edad; 28 A&ntilde;os<br>Jerarquia: Agente</p>\r\n<p>Hace 2 a&ntilde;os esta en la policia.</p>\r\n<p>Trabajo actual: En D1. en la parte de registros de archivos.</p>\r\n<p>Motivo de consulta:</p>\r\n<p>Reciente separacion con su pareja, padre de su hijo por sufrir violencia psicologica constantemente. Necesita ayuda psicologica para abordar el duelo.&nbsp;</p>', '12', '2025-03-13 16:46:11'),
(510, 'MALLEA LEANDRO ', '45634571', '1111-11-11', '2645309072', '<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; HISTORIA CLINICA&nbsp;</p>\r\n<p>PACIENTE INGRESA LUNES 10/03</p>\r\n<p>&nbsp;DIAGNOSTICO DE ESGUINCE GRADO 1.&nbsp;</p>\r\n<p>PRIMER INGRESO</p>\r\n<p>ALTA: MIERCOLES 19/03</p>\r\n<p>&nbsp;</p>', '13', '2025-03-14 22:38:13'),
(511, 'VAZQUEZ, HILDA', '93583619', '0001-01-01', '2644046557', '<p>PACIENTE INGRESA EL DIA 18/03/25 CON DIAGNOSTICO DE CALAMBRES EN AMBAS PANTORRILLAS Y DOLOR REFERIDO.</p>\r\n<p>5 SESIONES DE FISIOKINESIOTERAPIA</p>\r\n<p>PACIENTE CON TRASLADO DE LA DIVISION</p>', '16', '2025-03-18 15:46:53'),
(512, 'Montaña Estefania', '34696251', '1989-03-19', '2646097478', '<p>Edad: 36 a&ntilde;os<br>Ocupacion: Policia<br>Convive: \" hijos<br>Jerarquia: Cabo<br>Trabaja: D1 desempe&ntilde;ando diversas funciones, estando en mesa de entrada, logistica, choferm etc. Desde hace un a&ntilde;o.<br>Domicilio: B&ordm; Conjunto 1. Mza 6. Casa 7.</p>\r\n<p>Desde hace 11 a&ntilde;os es policia.</p>\r\n<p>Motivo de consulta:&nbsp;</p>\r\n<p>Indicadores de depresion, padeciendo durante un tiempo falta de ganas para ealziar actividades, salir de la casa, ansiedad, dificultad para conciliar el sue&ntilde;o. Angustia constante.&nbsp;</p>\r\n<p>padecio depresion pos parto con el 2do hijo&nbsp;</p>\r\n<p>En la actualidad retomo la carrera de abogacia, la cual busca estudiar en tiempos libres.&nbsp;&nbsp;</p>\r\n<p>Respecto al tratamiento psicologico iniciado a principios de marzo del 2025 asistio solo a 3 sesiones, donde en algunas oportuidades donde no pudo asistir aviso para poder reprogramar el turno pero las ultimas sesiones no aviso y hablo recien al otro dia del turno expresando que habia tenido una complicacion y que en realidad necesitaba turno para su hijo, observando poco compromiso con la terapia, por lo cual se considera oportuno darle lugar de atencion a otro afiliado que se encuentra en espera.&nbsp;</p>\r\n<p>&nbsp;</p>', '12', '2025-03-19 10:56:58'),
(513, 'Tejada Iris', '24879109', '1975-10-13', '2644454917', '<p>Edad: 49 a&ntilde;os<br>Estado civil: Casada.<br>Convive: Marido e hijas<br>Ocupacion: Trabaja en casa de familia.<br>Domicilio: Chaco 2049. Chimbas<br><br>Motivo de consulta:&nbsp;</p>\r\n<p>Hace 9 meses se realizo un by pass gastrico por lo cual ha solicitud del medico le suguiere realizar terapia psicologica para acompa&ntilde;ar el proceso por el que se encuentra atrabezando ya que el mismo tiene gran impacto psicologico.</p>\r\n<p>Siente poco apoyo de su familia respecto a lo que a atravesado con su operacion.&nbsp;</p>\r\n<p>&nbsp;</p>', '12', '2025-03-19 11:05:03'),
(514, 'Perez juan Jose', '32353125', '1986-05-15', '2645322482', '<p>Edad: 38 a&ntilde;os<br>Estado Civil: Casado.<br>Ocupacion: Policia.<br>Jerarquia: Cabo 1ro.&nbsp;<br>Convive: Esposa e hijo.<br>Domicilio: B&ordm; la chimbera 2. Mza B. Casa 16. 25 de mayo<br>Trabaja: Casualina como suboficial de guardia.</p>\r\n<p>Motivo de Consulta:</p>\r\n<p>Asiste a terapia psicologica por voluntad propia ya que atraviesa ciertas dificultades con su matrimonio habiendo tenido reiteradas separaciones y quiere trabajar en poder estar mejor y ver si puede rescatar la relacion.&nbsp;</p>\r\n<p>Perez asiste a 3 sesiones, donde a partir del 4to encuentro no se presenta y luego semanas despues avosa que le gustaria retomar terapia, orotgandole turno para el 19/05/25 11:30hs segun el siendo el turno mas conveniente para poder asistir. LLegado el dia no se presenta y tampoco da aviso de su ausentismo.&nbsp;</p>', '12', '2025-03-19 11:08:29'),
(515, 'Cortez Ludmila', '53932167', '2014-07-08', '2645682277', '<p>Diagn&oacute;stico: Fractura metatarciana</p>\r\n<p>Observaciones PTE QUE COMIENZA EN EL D&Iacute;A DE LA FECHA 19/03/2025</p>\r\n<p>Cantidad de sesiones:&nbsp; 10</p>\r\n<p>ALTA KIN&Eacute;SICA: dada de alta</p>', '9', '2025-03-20 13:30:53');
INSERT INTO `historias_clinicas` (`idhistoria`, `nombre`, `dni`, `fecha_nacimiento`, `telefono`, `texto`, `usuario_carga`, `fecha_carga`) VALUES
(516, 'Rodruigez Jeremias', '45981303', '2005-10-10', '2646612110', '<p>Edad: 20 a&ntilde;os<br>Convive: Madre<br>Estudia: Arquitectura&nbsp;<br>padre policias<br><br><strong>motivo de consulta:&nbsp;</strong><br><br>Mala relacion con su madre, le gustaria adquirir herramientas para sobrellevar la relacion y que no le afecte en sus otros ambitos como el de la relacion con su novia. Aprender a poner limites y trabajar baja autoestima.&nbsp;</p>', '12', '2025-03-20 14:53:47'),
(517, 'Galdeano Angela', '37741934', '1995-12-02', '2645818105', '<p>dign&oacute;stico: Traumatismo de hombro&nbsp;</p>\r\n<p>Observaciones: Paciente que comienza en el d&iacute;a de la fecha 18/03/2025</p>\r\n<p>Cantidad de sesiones 10</p>\r\n<p>ALTA KIN&Eacute;SICA: DADA DE ALTA</p>', '9', '2025-03-20 16:31:03'),
(518, 'ALVAREZ EMMA ', '6415188', '1111-11-11', '2645289454', '<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; HISTORIA CLINICA&nbsp;</p>\r\n<p>PACIENTE INGRESA EN EL MES DE MARZO CON DIAGNOTICO ARTOSIS DE RODILLA (ARTROSIS GENERALIZADA), COLONOSTOMIA , Y CA DE ESTOMAGO LO CUAL ESTA EN TRATAMIENTO MEDICO.</p>\r\n<p>PACIENTE CON DEPRESION AGUDA, OBESIDAD&nbsp; Y DIFICULTAD PARA CAMINAR. FUE OPERADA DE LA VITA EN EL MES DE FEBERO.</p>\r\n<p>EDAD 74 A&Ntilde;OS. 5 HIJOS. USA ANDADOR Y RODILLERA LADO DERECHO (VALGO PATOLOGICO PRODUCTO DE LA ARTROSIS) SE OBSERVA EN RODILLA IZQUIERDA UN QUISE EN LA ZONA ROTULIANA, REFIERE QUE SALIO PRODUCTO DE UN GOLPE.</p>\r\n<p>INGRESA : SEGUNA SEMANA DE MARZO.</p>\r\n<p>ALTA:&nbsp;</p>', '13', '2025-03-25 19:04:30'),
(519, 'Adrian Deniz ', '39994760', '1997-08-10', '2646724698', '<p>Edad: 27 a&ntilde;os<br>Convive: Padres, hermana mujer y la hija de su hermana.<br>Domicilio: B&ordm; Buenaventura. Rawson.<br>Jerarquia: Agente<br>Trabajo: En la actualidad se encuentra trabajando en Unidad de prevenvion barrear. rawson. Donde realiza tareas de motorista, infante, servicios externos, entre otros.&nbsp;<br>Estado Civil: Soltero.</p>\r\n<p>Motivo de consulta:</p>\r\n<p>Presenta conflictos con su ex pareja, la cual es madre de su hijo. Tiene problemas significativos de comunicacion y le realiza demandas ficticias para amenzarlo con volver a ver al infante constantemente, por lo cual busca realizar terapia para obterner herramientas de como manejar la situacion y no permitir que le afecte animicamente en el resto de los ambitos de su vida laboral, como emocional y social.&nbsp;</p>', '12', '2025-03-26 15:42:46'),
