(522, 'MOREIRA JAZMIN', '46484217', '0001-01-01', '2644629279', '<p>23/01/25 PESO 96.5 INICIO- RECE VEGETARIANAS- TECNICAS</p>\r\n<p>03/02/25 PESO 95.6 RECE VEGETALES PROTEICAS HABITOS&nbsp;</p>\r\n<p>12/03/25 PESO 97.3 PLAN REDUCIDO-SOPAS C/PERIODO 8/03&nbsp;</p>\r\n<p>&nbsp;</p>', '18', '2025-03-27 21:15:39'),
