(525, 'Bustos Ian ', '52551067', '2012-09-15', '2644000373', '<p>Edad: 12 a&ntilde;os<br>Escuela: Naciinal de Rawson. Turno tarde.<br>Domicilio: Entre Rios, 671 (s). Rawson<br>Genero: Masculino.<br>Convive: Madre<br>Ocupacion de la madre: Policia, agente. Trabaja en la comisaria 25.</p>\r\n<p>Motivo de consulta:</p>\r\n<p>Entrada a la asolescencia. Presenta cambios repentinos en su personalidad, ha comenzado a mentir y manifiesta actualmente querer conocer al padre, por lo cual la madre busca ayuda psicologica para saber como abordar el tema y acompa&ntilde;ar al adolescente.&nbsp;</p>\r\n<p>Antecedentes medicos:</p>\r\n<p>Padece hipotiroidismo congenito.</p>\r\n<p>A los 5 a&ntilde;os estubo internado por bilirrubina hasta que le descubrieron su enfermedad y logro ser estabilizada.</p>', '12', '2025-03-31 16:15:34'),
(526, 'Gonzalez Denis', '50808865', '2011-05-04', '2644404850', '<p>Edad: 13a&ntilde;os<br>Colegio: El prado. Asiste turno ma&ntilde;ana.<br>Hace danza clasica en el pablova.<br>Convive con sus padres, 2 hermanas y el hijo de su hermana mayor.<br>Ocupacion de los padres: Padre policia, madre ama de casa.<br>Domicilio: B&ordm; Natania 8. MZA a. Casa 9<br><br>Motivo de consulta: Sufre Bullyng desde 2024 en el colegio, logrando generar en la adolescente gran impacto psiquico, disminuyendo su autoestima, generando sentimientos de inseguridad como tambien rechazo a querer ir al colegio, tal impacto termino haciendo que la adolescente repitiera en el 2024.&nbsp;</p>', '12', '2025-03-31 16:20:42'),
