(555, 'De Los Santos Daiana ', '35850366', '1992-01-20', '2645444516', '<p>Edad: 33 A&ntilde;os<br>Estado Civil: Soltera<br>Convive: Madre y hermanos.<br>Domicilio: Calle Alberdi. Rawson.<br><br>Motivo de Consulta:<br><br>Hostigamiento en el trabajo anterior, por lo cual se hace el traslado pero desde sanidad deciden retenerle el arma, por lo cual, le solicitan a Daiana realizar tratamiento psicologico por lo menos 3 meses para la consideracion de devolverle el arma.&nbsp;<br><br></p>\r\n<p>&nbsp;</p>', '12', '2025-04-04 14:38:56'),
(556, 'Riveros Franco', '37646606', '1993-05-04', '2645801048', '<p>Edad: 31 a&ntilde;os<br>Domicilio_ Rivadavia, B&ordm; Andacoyo (chimbas)<br>Jerarquia: Agente.<br>Convive: Padres e hijo mayor de 13a&ntilde;os<br>Tiene 3 hijos con su ex pareja. Actualmente se encuentra separado de la misma.<br>Trabaja: Comisaria la 2da desde hace 4 a&ntilde;os y medio.<br><br>Motivo de consulta:<br><br>Principios del 2023 luego de una operacion vuelve a presentar carpeta medica a raiz de que estando de civil enfrente un robo, donde los asaltantes le vuelve a descolocar el hombro y tienen qie volver a intervenirlo quirurxicamente, siendo que ademas no puede enfrentar ladrones estando de civil por lo cual se le retiene el arma y le solicitan desde sanidad realizar terapia psicologica por al menos 4 meses.&nbsp;&nbsp;</p>\r\n<p>Comienza terapia 7 de abril del 2025, siendo que en el a&ntilde;o 2023 se habria presentado a terapia asistiendo una sola vez y luego no asistinedo al turno que se le dio nuevamente, volviendo a solicitar turno 2 a&ntilde;os despues.&nbsp;</p>', '12', '2025-04-04 14:43:35'),
