(569, 'Ivan Gramajo', '34059999', '1990-10-10', '2644170980', '<p><strong>Edad: </strong>35 a&ntilde;os<br><strong>Domicilio</strong>: Calle laspiu. 327 (o) Chimbas.<br><strong>Funcion</strong>: Oficial de Servicio.<br><strong>Trabaja: </strong>Comisaria 13<br><strong>Convive: </strong>Padres<br><strong>estado civil</strong>: Casado. (separado actualmente)<br><br>Hijos 2 con sus primeras 2 parejas. Con su primer hijo no tiene relacion, solo con su segunda hija, producto de su segunda pareja la cual es policia.</p>\r\n<p><strong>Motivo de consulta:</strong></p>\r\n<p>Separacion hace un mes de su ultima pareja, de la cual se encuentra casado aun, la misma es policia.&nbsp;<br>Presenta angustia constante, inseguridad, miedo a quedarse solo por lo cual busca ayuda psicologica para poder trabajar su seguridad y autoestima, comenzando tratamiento psicologico el dia 14 de abril del 2025.</p>\r\n<p>19 de mayo presenta su primer ausente dando aviso 1 hora antes que por cuestiones laborales no podra asisitir al turno asignado&nbsp;</p>', '12', '2025-04-14 16:19:01'),
(570, 'galeote Vera Micaela', '40962694', '1998-02-10', '2645578827', '<p>Edad: 27 a&ntilde;os<br>Convive: Sola con su hija<br>jerarquia: oficial ayudante<br>Trabaja Comisaria 27. como administrativa.<br><br>Motivo de consulta:</p>\r\n<p>Trancitar y elaborar el duelo por la separacion con el papa de su bebe de 5 meses, como tambien el hecho de que su ex pareja no presenta interes en estar con su hija o hacerse cargo como corresponde. Esta situacion le ha generado gran angustia y permanecer de bajo animo.&nbsp;</p>\r\n<p>Comienza terapia 9 de abril del 2025</p>', '12', '2025-04-15 11:15:18'),
(571, 'Morales Lara', '50039770', '2010-04-01', '2645067616', '<p>Edad: 15 a&ntilde;os<br>sexo: femenino<br><br>Motivo de consulta:</p>\r\n<p>Asiste a terapia por derivacion del juzgado para transitar la separacion de sus padres como tambien que le va mal en la escuela y habria repetido de a&ntilde;o.&nbsp;</p>', '12', '2025-04-15 11:56:10'),
