(584, 'Valdez Brisa', '42452101', '0000-00-00', '2645086985', '<p>Edad: 25 a&ntilde;os<br>Convive: Padres, hija, hermana, el hijo de su hermana y su pareja (policia)<br>Actualmente se encuentra realizando tareas del hogar.<br>Secundario: Completo.<br>Domicilio: Pocito.<br><br>Motivo de consulta:</p>\r\n<p>Se encuentra desbordada y angustiada por su situacion actual, siendo que solo vive para su hija, le cuesta poner limites siendo que vive con sus padres y la desautorizan.&nbsp;</p>\r\n<p>La misma recurre a terapia para encontrar herramientas y recursos para abordar la situacion que la hace desbordar.&nbsp;</p>', '12', '2025-04-30 11:43:42'),
(585, 'Debora Noelia  Avila', '33120490', '1987-08-10', '2645841227', '<p>Edad: 37<br>Convive: esposo y 2 hijos<br>Ocupacion: Ama de casa<br>Docimilio: Rivadavia<br><br></p>\r\n<p>Motivo de consulta:</p>\r\n<p>Busca ayuda psicologica para transitar el duelo por la perdida reciente de su padre.&nbsp;</p>', '12', '2025-04-30 11:46:47'),
(586, 'NATANAEL ', '54173585', '2015-02-28', '2645573431', '<p>NATANAEL TIENE 10 A&Ntilde;OS, ACUDE A LA ESCUELA PROVINCIA DE SALTA. EL NI&Ntilde;O CONVULCIONO A LOS 3 A&Ntilde;OS, DIFICULTAD EN LA LECTO ESCRITURA. HIPERCATIVO, LE CUESTA CONCENTRARSE. TIENE DOS HERMANOS POR PARTE DE LA MADRE, NO CONOCE A SU PADRE BIOLOGICO.&nbsp;</p>', '19', '2025-05-06 15:40:55'),
(587, 'Ibañez Romina', '38075041', '1994-02-24', '2645467426', '<p><strong>Edad: </strong>31 a&ntilde;os<br><strong>Sexo:</strong> Femenino<br><strong>Ocupacion: </strong>Polic&iacute;a<br><strong>Trabajo: </strong>Division siniestros laborales<br><strong>Jerarquia:</strong> Agente.<br><strong>Estado Civil</strong>: Soltera</p>\r\n<p><strong>Motivo de consulta:</strong></p>\r\n<p>Es derivada desde el area de sanidad para realizar sesiones de psicologia ya que la misma realiza el pedido de cambio de escalafon sugerido por su medico clinico teniendo en cuenta que la misma deberia realizar trabajos administrativos y no hacer servicios en la calle para no estar expuesta al sol por la enfermedad de Lupus la cual padece desde los 15 a&ntilde;os, siendo diagnosticada a los 19.&nbsp;</p>\r\n<p>Realizar acompa&ntilde;amiento y asesoramiento a la misma.</p>', '12', '2025-05-08 16:41:03'),
(588, 'Correa Fatima', '43078209', '0000-00-00', '2645699993', '<p>Edad: 24 a&ntilde;o<br>Convive; Padres y hermanas<br>Padres: Policia&nbsp;<br>Domicilio: Santa Lucia.<br><br></p>\r\n<p>Motivo de consulta:</p>\r\n<p>Separacion con el novio, desencadenando crisis de angustia.&nbsp;</p>', '12', '2025-05-09 15:13:24'),
(589, 'Garcia Rodrigo', '2644880453', '1991-02-02', '2644880453', '<p>Edad: 34 a&ntilde;os<br>Jerarquia: Cabo<br>Trabaja: Unidad operativa teresa de calcuta. (Rawson)<br>Domicilio: Villa San Antonio. Rivadavia.</p>\r\n<p>Motivo de consulta:</p>\r\n<p>Es derivado de sanidad policial por sobre peso. El mismo mide 1.78mt y pesa 150kg siendo riesgoso para su salud y poniendo en juego su profesion, por lo cual se considera oportuno realizar retencion de portacion y tenencia de arma hasta que no realice un proceso terapeutico que le ayude a trabajar la ansiedad y emociones que estarian interfiriendo con su salud llevandolo a generar un trastorno de la conducta alimentaria.&nbsp;</p>\r\n<p>Antecedentes medicos: Padece de Hipertension.&nbsp;<br>Antecedentes familiares: Madre diabetica &ordm; 2&nbsp;</p>\r\n<p>&nbsp;</p>', '12', '2025-05-14 14:38:42'),
(590, 'Benitez Giovanni', '56589229', '2017-06-28', '2644740109', '<p>Edad: 7 a&ntilde;os<br>Convive: Madre (policia), pareja de la madre y hermana mayor.<br>Domicilio: B&ordm; Don Jose. Pocito.&nbsp;</p>\r\n<p>Motivo de consulta:</p>\r\n<p>Se solicita consulta psicologica por parte de la figura materna para ayudar a trancitar el querer conocer a su figura paterna siendo que este no resulta ser una persona idonea para establecer un vinculo con el hijo ya que no lo conoce por haber estado preso desde que nacio. El mismo es violento y ha cometido delitos de robo a mano alzada siendo policia.&nbsp;</p>\r\n<p>La madre durante el embarazo recibio por parte del progenitor masculino violencia de genero tanto fisica como psicologica llevandola a que su hijo no conozca ni sepa de la existencia de su padre. El presunto habria salido hace unos meses de prision teniendo prision domiciliaria y tiene miedo que se acerque a su hijo y quiera conocerlo y hacerle da&ntilde;o.</p>\r\n<p>Comenzaria terapia psicologica el 28 de mayo del 2025</p>', '12', '2025-05-14 14:43:03'),
(591, 'EMMA AHUMADA ', '32782514', '2019-06-07', '2645563301', '<p>EL PACIENTE NO ASISTIO A SU TURNO DEL DIA 16 DE MAYO SWBISO A COMPLICACIONES CON SU SALUD.&nbsp;</p>', '19', '2025-05-16 12:21:33'),
(592, 'AITANA DOMINGUEZ', '58267204', '2020-05-08', '2646259497', '<p>AITANA ES HIJA DE JULIA DOMINGUEZ POLICIA RECIENTEMENTE INGRESADA TRABAJA EN LA COMISARIA 34. RECIENTEMENTE AITANA TIENE PROBLEMAS CONDUCTUALES EN EL JARDIN (5 A&Ntilde;OS) Y LA DOCENTE SOLICITO UNA CONSULTA CON LA PSICOPEDAGOGA.&nbsp;</p>', '19', '2025-05-16 12:25:43'),
(593, 'THIAGO VALENTIN CALIVAR ', '58830825', '2018-05-26', '2645623778', '<p>THIAGO TIENE 6 A&Ntilde;OS UNA DISPACIDAD LEVE EN EL APRENDIZAJE. ACUDE A LA ESCUELA CON DAI. DIAGNOSTICO TRASTORNO ESPECIFICO DEL DESARROLLO DEL HABLA Y LENGUAJE</p>', '19', '2025-05-16 12:29:11'),
(594, 'YUTHIEL RIOS ', '54373770', '2015-01-26', '2644734372', '<p>YUTHIEL TIENE 10 A&Ntilde;OS. NO TIENE DIAGNOTICO. ACUDE A LA ESCUELA TIMOTEO MARADONA. NO TIENE&nbsp; ADQUIRIDA LA LECTO ESCRITURA, RECIBE TERAPIA FONOAUDIOLOGICA. INVIERTE LETRAS.</p>\r\n<p>EL DIA 16 TENIA TURNO A LAS 9 AM, NO SE DIO AVISO&nbsp; DE QUE NO ASISTIRIA, SE COMUNICO LA FONOAUDIOLOGA PARA TRABAJAR INTERDISCIPLINARIAMENTE.&nbsp;</p>', '19', '2025-05-16 12:39:20'),
(595, 'GENNARO PEREZ', '58159566', '2020-03-27', '2645614528', '<p>GENNARO TIENE 5 A&Ntilde;OS, ACUDE AL JARDIN DE LA ESCUELA SAN MARTIN CON DAI. DIAGNOSTICO TRASTORNO ESPECIFICO DEL LENGUAJE Y RETRASO MADURATIVO LEVE.</p>', '19', '2025-05-16 12:41:52'),
(596, 'SOFIA MOLINA ', '53552471', '0013-12-18', '2644132110', '<p>SOFIA TIEN 11 A&Ntilde;OS, ACTUALMENTE VA A 6TO GRADO. EL MOTIVO DE CONSULTA ES QUE LA ALUMNA NO LEE ADECUADAMENTE PARA SU EDAD CRONOLOGICA .</p>', '19', '2025-05-16 12:47:52'),
(597, 'Ahumada Diego', '24934897', '1976-08-08', '2645433287', '<p><strong>Edad: </strong>48 a&ntilde;os<br><strong>Ocupacion: </strong>Polic&iacute;a<br><strong>Jerarquia:</strong> Sargento 1ro.<br><strong>Estado civil</strong>: Viudo (fallece su esposa 12 de enero del 2025)<br><strong>Trabajo:</strong> Escuela de musica, donde cumple funcion de sonidista.<br><strong>Convive: </strong>Su hija menor de 16 a&ntilde;os<br><strong>Domicilio: </strong>San martin</p>\r\n<p><strong>Motivo de consulta: </strong>Abordar y elaborar el duelo por el fallecimiento de su mujer, como adquirir herramientas para acompa&ntilde;ar a su hija y entenderla ya que de golpe se encuentra siendo padre solo y de una adolescente. Siente culpa por el fallecimiento de su se&ntilde;ora.&nbsp;</p>\r\n<p><strong>Antecedentes medicos:</strong></p>\r\n<p>Padecio hace 10 a&ntilde;os de depresion y ataques de panico.</p>\r\n<p><strong>Natecedentes familiares</strong>:&nbsp;</p>\r\n<p>Abuela y madre depresion.</p>', '12', '2025-05-16 15:16:49'),
(598, 'De los Santos Maximiliano', '34697381', '1990-04-30', '2646053700', '<p>Edad: 35 a&ntilde;os<br>Convive: Madre y hermanos<br>Policia<br>Jerarquia: Oficial Inspector.&nbsp;<br>Domicilio. Calle Alberdi. Rawson.<br>Trabaja en inteligencia criminal.&nbsp;</p>\r\n<p>Motivo de Consulta:</p>\r\n<p>A raiz de una denuncia penal en su contra por agresion y violencia de genero se eleva una demanda y en sanidad policial hacen derivacion al area de psicologia.&nbsp;<br>El poder judicial ya habria otorgado el alta y el psicologo anterior que asistio durante 4 meses al Oficial no habria encontrado signos de que la denuncia sea real pero aun asi se sigue derivando al sujeto a atencion psicologica, comenzando tratamiento en la divivison en el mes de mayo a los dias 20 del presente mes.&nbsp;</p>', '12', '2025-05-20 15:39:15');
